(115, 'Frederick Brown Jr. Amphitheater', '201 McIntosh Trail', 'Peachtree City', 11, 11, '30269', '770.631.0630', 'http://www.amphitheater.org/', '', 4, '2012-07-04 22:31:15', 'screenscrape', '2012-07-12 14:05:55', 'gbarnard'),
(116, 'Arena at Gwinnett Center', '6400 Sugarloaf Parkway', 'Duluth', 12, 11, '30097', '800.224.6422', 'http://www.gwinnettcenter.com/Home.6.0.html?&no_cache=1', '', 5, '2012-07-04 22:31:15', 'screenscrape', '2012-07-11 22:27:24', 'gbarnard'),
(117, 'Cobb Energy Performing Arts Centre', '2800 Cobb Galleria Parkway', 'Atlanta', 1, 11, '30339', '770.916.2800', 'http://www.cobbenergycentre.com/', 'The Cobb Energy Performing Arts Centre is the first major performing arts facility built in metro Atlanta in four decades.  The Centre is located in northwest Atlanta, at 2800 Cobb Galleria Parkway at Akers Mill Road, adjacent to I-75 inside I-285.  \r\n\r\nThe Cobb Energy Centre is a premier venue for Broadway shows, ballet, concerts, educational shows, family performances, opera, corporate meetings and events.', 5, '2012-07-04 22:31:15', 'screenscrape', '2012-07-11 23:00:08', 'gbarnard'),
(118, 'Fox Theatre Atlanta', '660 Peachtree Street NE', 'Atlanta', 1, 11, '30308', '404.881.2100', 'http://www.foxtheatre.org/', '', 5, '2012-07-04 22:31:15', 'screenscrape', '2012-07-05 14:37:19', 'hesomp'),
(119, 'Aarons Amphitheatre at Lakewood', '2002 Lakewood Way', 'Atlanta', 1, 11, '30315', '404-443-5090', '', 'Opened in 1989 with seating for 19,000. 7,000 seat are covered leaving and 12,000 seats are on the lawn.', 4, '2012-07-04 22:31:15', 'screenscrape', '2012-07-11 22:42:41', 'trdalyjr@gmail.com'),
(120, 'Wild Bills', '2075 Market Street', 'Duluth', 12, 11, '30096 ', '678.473.1000', 'http://wildbillsatlanta.com/', 'Wild Bill''s is America''s Largest Dance Club and Concert Hall.\r\n\r\nWild Bill''s Atlanta, home of the famous Wild Bill''s Wild Girl''s, is located in Duluth near Gwinnett Place Mall off of I-85. Come party with 5000 of your friends at the best night club and bar in metro Atlanta. Featuring different bands and artist every weekend offering a wide variety of night life.', 5, '2012-07-04 22:31:15', 'screenscrape', '2012-07-14 23:08:15', 'trdalyjr@gmail.com'),
(121, 'Turner Field', '755 Hank Aaron Drive Southeast', 'Atlanta', 1, 11, '30315', '404.522.7630', 'http://atlanta.braves.mlb.com/atl/ballpark/index.jsp', 'After opening in 1997, the "Home of the Braves" has quickly become an Atlanta landmark and the benchmark for future baseball park design. Turner Field combines the nostalgia and the atmosphere of old-time baseball with state-of-the-art family entertainment unlike that of any other park.\n\nTurner Field is unrivaled in its blend of technology and entertainment. At all times, fans are entertained and informed of Turner Field activities through superior sound systems, the BravesVision video board in center field, the PlazaVision board in the Fan Plaza and over 500 television monitors situated throughout Turner Field. The BravesVision video board is 29 feet by 38 feet, weighs over 21 tons and features over 331,000 fluorescent light bulbs. The PlazaVision board is 17 feet by 22 feet. These two huge boards make Turner Field unique among all sports facilities as two completely different shows can be produced - one for the seating bowl and one for the Plaza. Inside the ballpark, fans are prompted to do the tomahawk chop by the 27-foot long "chopping" neon tomahawk located atop the video board, and are kept informed of the latest scores around the leagues by the out-of-town scoreboard.', 2, '2012-07-04 22:31:15', 'screenscrape', '2012-07-05 03:11:50', 'hesomp'),
(122, 'Masquerade (Atlanta)', '695 North Avenue NE', 'Atlanta', 1, 11, '30308', '404.577.8178', 'http://www.masqueradeatlanta.com/', '', 5, '2012-07-04 22:31:15', 'screenscrape', '2012-07-12 14:06:18', 'gbarnard'),
(123, 'Verizon Wireless Amphitheatre at Encore Park', '2200 Encore Parkway', 'Alpharetta', 2, 11, '30009', '404.733.5010', 'http://www.vzwamp.com/', 'Set on 45 acres of beautifully-landscaped wooded land in Alpharetta, GA, north of Atlanta in Fulton County, the 12,000-seat Verizon Wireless Amphitheatre at Encore Park will seat 7,000 under a roof, and another 5,000 on a lawn area. The venue provides a unique setting for both music lovers and first-time concertgoers.\r\nThe Amphitheatre has quickly become characterized by its distinctive fan-shaped roof, comprised of a translucent cloth-like material, suspended over a steel-framed structural system. Its beautiful park-like atmosphere allows concertgoers to enjoy music under the trees, surrounded by a number of large heritage trees, plants, and flowers all native to the park.\r\nThe state-of-the-art venue  nominated by Pollstar Concert Industry Awards as 2009 Best Major Outdoor Concert Venue  serves as the summer home of the Atlanta Symphony Orchestra. The scope of Verizon Wireless Amphitheatre at Encore Park has brought a new dimension to the regions seasonal artistic offerings featuring concerts with the internationally-recognized Atlanta Symphony Orchestra, leading popular presentations, as well as an emphasis on community events  including high school graduations, local fundraising events, and collaborations to create family-themed days, high school music concerts, and competitions. Upon the opening of the Amphitheatre in May 2008, the ASO became the only U.S. orchestra to perform and present in its concert hall and in two amphitheatres. For 36 years, the ASO has presented and performed concerts at Chastain Park Amphitheater, the legendary award-winning 6,500-seat venue in Atlanta.\r\nVerizon Wireless Amphitheatre at Encore Park is owned by the Robert W. Woodruff Arts Center, Inc., and is operated by the Atlanta Symphony Orchestra. In addition to the Amphitheatre, Phase II long-range plans for Encore Park for the Arts  established by a consortium of prominent community leaders in north Fulton County  include a performing and visual arts complex and education center.', 4, '2012-07-04 22:31:15', 'screenscrape', '2012-07-12 03:32:54', 'trdalyjr@gmail.com'),
(124, 'Variety Playhouse', '1099 Euclid Ave NE', 'Atlanta', 1, 11, '30307', '404.524.7354', 'http://www.variety-playhouse.com/', 'The Variety Playhouse is a combination theater and nightclub. Our seating features a mixture of theater-style seats, tables and chairs and dancing and standing areas. Our capacity varies depending on the seating configuration. All of our shows are general admission. For many of the shows, there is limited seating along with standing areas', 5, '2012-07-04 22:31:15', 'screenscrape', '2012-07-12 14:14:46', 'gbarnard'),
(125, 'The Tabernacle', '152 Luckie Street', 'Atlanta', 1, 11, '30303', '404.659.9022', 'http://tabernacleatl.com/', 'The Tabernacle, known colloquially as The Tabby, is a mid-size concert hall in the U.S. city of Atlanta.', 5, '2012-07-04 22:31:16', 'screenscrape', '2012-07-13 03:34:41', 'hesomp'),
(126, 'Chastain Park Amphitheatre', '4469 Stella Dr', 'Atlanta', 1, 11, '30327', '404-733-5012', 'http://www.classicchastain.com/location/mapdirections/', 'Chastain Park Amphitheatre is a small, outdoor venue located off of Roswell Road in the Buckhead area of Atlanta. Recognized as one of the most popular amphitheatres in the country, Chastain sets the standard for summer entertainment in Atlanta. Many of music''s biggest names from every musical genre have appeared on the Chastain stage. Chastain is known for its relaxed atmosphere complementing the performances.', 4, '2012-07-04 22:31:16', 'screenscrape', '2012-07-12 02:24:26', 'trdalyjr@gmail.com'),
(127, 'Philips Arena', '1 Philips Drive', 'Atlanta', 1, 11, '30303', '404-878-3000', 'http://www.philipsarena.com/', 'Philips Arena is a multipurpose indoor arena located in Atlanta, Georgia. It was completed and opened in 1999 to replace The Omni, at a cost of $213.5 million.', 2, '2012-07-04 22:31:16', 'screenscrape', '2012-07-12 03:04:23', 'trdalyjr@gmail.com'),
(128, 'Stone Mountain Park', '1000 Robert E. Lee Drive', 'Stone Mountain', 13, 11, '30083', '770-498-5690', 'http://www.stonemountainpark.com/', 'Located on 3,200 acres of natural beauty, Stone Mountain Park features a wide variety of fun family activities and things to do in the Atlanta, Georgia area. Amazing adventures await as you discover interactive children''s attractions. Plus you''ll not want to miss dozens of fun annual events such as Spring FUN Break, Summer at the Rock, Yellow Daisy Festival, Indian Festival and Pow Wow, Stone Mountain Christmas and Snow Mountain. Stone Mountain activities are suitable for all ages.', 14, '2012-07-04 22:31:16', 'screenscrape', '2012-07-12 14:14:29', 'gbarnard'),
(129, 'Coolray Field', '2500 Buford Drive Northeast', 'Lawrenceville', 14, 11, '30043', '678.277.0300', 'http://gwinnett.braves.milb.com/team1/page.jsp?ymd=20090108&content_id=493423&vkey=team1_t431&fext=.jsp&sid=t431', 'Coolray Field is a 10,475-seat minor league baseball park in Lawrenceville, Georgia. It is the home field of the Gwinnett Braves, the Triple-A affiliate of the Atlanta Braves.', 2, '2012-07-04 22:31:16', 'screenscrape', '2012-07-11 23:03:12', 'gbarnard'),
(130, 'Center Stage Theatre', '1374 West Peachtree Street', 'Atlanta', 1, 11, '30309', '404.885.1365', 'http://www.centerstage-atlanta.com/', 'Center Stage Theater is an icon in the Atlanta Music and Performing Arts Community! An intimate venue where every seat is a winner with premier sound and lighting systems, a cozy lounge area and prime location in the heart of Midtown, Center Stage Theater stands apart from the rest!', 5, '2012-07-04 22:31:17', 'screenscrape', '2012-07-11 22:54:19', 'gbarnard'),
(131, 'Anderson Music Hall', '1311 Music Hall Road', 'Hiawassee', 15, 11, '30546 ', '706-896-4191', 'http://georgiamountainfairgrounds.com/venueInfo.php#anderson', 'Anderson Music Hall has hosted countless musical legends since it was constructed in 1979. This 2,900-seat theatre is an ideal spot to take in a performance during the many musical events scheduled at the fairgrounds throughout the year. Anderson Music Hall is also available for private groups and functions.', 4, '2012-07-10 01:06:50', 'screenscrape', '2012-07-11 02:50:11', 'wsblejwas@gmail.com'),
(132, 'AT&T Center', 'One AT&T Center Parkway', 'San Antonio', 16, 46, '78219', '(210) 444-50', 'http://www.attcenter.com/', 'The AT&T Center is home to the NBA 4-time world championship San Antonio Spurs, the American Hockey League San Antonio Rampage, the WNBA San Antonio Silver Stars and the annual San Antonio Stock Show and Rodeo. The AT&T Center is one of the nations leading entertainment venues hosting acts such as George Strait, The Rolling Stones, Van Halen, Josh Groban, Shakira, Trans-Siberian Orchestra and many more.', 2, '2012-07-10 01:06:50', 'screenscrape', '2012-07-16 04:23:56', 'hesomp'),
(133, 'Atlanta Civic Center', '395 Piedmont Avenue Northeast', 'Atlanta', 1, 11, '30308', '(404) 523-62', 'http://www.atlantaciviccenter.com/', 'The Atlanta Civic Center, with the largest stage in the Southeast, has played host to some of the world''s most highly anticipated Broadway productions, concerts, stage plays, operas and other events and meetings.', 5, '2012-07-10 01:06:51', 'screenscrape', '2012-07-11 03:04:48', 'wsblejwas@gmail.com'),
(134, 'The Earl', '488 Flat Shoals Avenue Southeast', 'Atlanta', 1, 11, '30316', '404-522-3950', 'http://badearl.com/', '', 12, '2012-07-10 01:06:51', 'screenscrape', '2012-07-12 03:28:07', 'trdalyjr@gmail.com'),
(135, 'Regal Atlantic Station Stadium 16', '261 19th Street Northwest', 'Atlanta', 1, 11, '30363', '404-347-9894', 'http://www.regmovies.com/', '', 15, '2012-07-10 01:06:51', 'screenscrape', '2012-07-12 14:13:00', 'gbarnard'),
(136, 'Nationals Park', '1500 South Capitol Street Southeast', 'Washington', 17, 9, '20003', '202-675-6287', 'http://washington.nationals.mlb.com/was/ballpark/index.jsp', 'Nationals Park is the current ballpark for the Washington Nationals of Major League Baseball. It is the first LEED-certified green major professional sports stadium in the United States.', 2, '2012-07-10 01:06:51', 'screenscrape', '2012-07-12 02:59:31', 'trdalyjr@gmail.com'),
(137, 'Atlanta Botanical Garden', '1345 Piedmont Avenue NE', 'Atlanta', 1, 11, '30309', '404.876.5859', 'http://www.atlantabotanicalgarden.org/', 'The mission of the Atlanta Botanical Garden is to develop and maintain plant collections for display, education, research, conservation and enjoyment.', 4, '2012-07-10 01:06:51', 'screenscrape', '2012-07-11 22:30:17', 'gbarnard'),
(138, 'Columbus Civic Center', '400 4th Street', 'Columbus', 18, 11, '31901', '706.653.4472', 'http://www.columbusciviccenter.org/', 'The Columbus Civic Center is a state-of-the-art multipurpose sports and entertainment facility with 10,000 arena seats, 23,000 square feet of flat floor space and 5,000 square feet of hospitality suites.\r\n\r\nThe arena is home to two professional sports franchises: the South Professional Hockey League''s Columbus Cottonmouths and the Southern Indoor Football League''s Columbus Lions. The Columbus Civic Center has over 300 event days per year, to include basketball, hockey, arena football, concerts, ice shows, conferences and conventions. In the last year, the arena has hosted events such as Disney on Ice, Shrine Circus, Cirque Dreams, The Gaithers, Monster Trucks, PBR Professional Bull Riding, Tyler Perry, Comedian Jeff Dunham, Taylor Swift, Gary Allan, Montgomery Gentry, Dierks Bentley, Buckcherry, TI, Mixed Martial Arts, The Greater Columbus Fair and more.', 5, '2012-07-10 01:06:51', 'screenscrape', '2012-07-11 23:01:19', 'gbarnard'),
(139, 'Marlins Park', '501 Marlins Way', 'Miami', 19, 10, '33125', '305-480-1300', 'http://miami.marlins.mlb.com/mia/ballpark/new_ballpark.jsp', 'Marlins Park is a baseball park in Miami, Florida. It is the current home of the Miami Marlins Major League Baseball team. It is located on 17 acres of the former Miami Orange Bowl site in Little Havana, about 2 miles west of Downtown.', 2, '2012-07-10 01:06:51', 'screenscrape', '2012-07-12 02:51:44', 'trdalyjr@gmail.com'),
(140, 'Classic Center Theatre', '300 N Thomas Street', 'Athens', 20, 11, '30601', '706.208.0900', 'http://www.classiccenter.com/', 'he Classic Center is northeast Georgia''s premier award winning convention center and performing arts theatre. Located in the heart of Downtown Athens, Georgia, The Classic Center provides unique meeting space, outstanding special events services and a wide range of entertainment options, making this unconventional convention center the choice for conferences, meetings and special events!\r\n\r\nThe Classic Center is under the auspices of The Classic Center Authority (CCA), a political subdivision of the state government, created on March 10, 1988, as enacted by the General Assembly of the State of Georgia. The five-member CCA board of directors is appointed by the Athens-Clarke County Commission.', 5, '2012-07-10 01:06:51', 'screenscrape', '2012-07-11 22:59:31', 'gbarnard'),
(141, 'Mable House Amphitheatre', '5239 Floyd Road', 'Mableton', 21, 11, '30126', '770.819.2943', 'http://www.mablehouse.org/amphitheatre.html', 'The Mable House Barnes Amphitheatre in Mableton, Georgia is a publicly owned facility designed to serve as an entertainment venue and performing arts program for citizens of Cobb County and the surrounding area.  The county management company presents performing arts programs, special events and concerts.', 5, '2012-07-10 01:06:51', 'screenscrape', '2012-07-12 02:47:40', 'trdalyjr@gmail.com'),
(142, 'Johnny Mercer Theatre', '301 W. Oglethorpe Ave.', 'Savannah', 22, 11, '31401', '912-651-6556', 'http://www.savannahcivic.com/cityweb/civiccenter.nsf', '', 5, '2012-07-10 01:06:51', 'screenscrape', '2012-07-12 02:43:59', 'trdalyjr@gmail.com'),
(143, 'Georgia Dome', '1 Georgia Dome Dr NW', 'Atlanta', 1, 11, '30313', '404-223-4042', 'http://www.gadome.com/', 'The Georgia Dome, the largest cable-supported domed stadium in the world, opened in 1992. Located in downtown Atlanta, the Dome is the home venue for the Atlanta Falcons, host to Super Bowl XXVIII and XXXIV, host of the gymnastics and basketball events for the 1996 Olympic Games and host to both a Men''s and Women''s NCAA Final Four. Annually, the Dome hosts the Bank of America Atlanta Football classic, the SEC Football Championship and the Chick-fil-A Bowl. The Dome is equipped to handle large non-sporting events which include everything from major trade shows to concerts by such entertainers as the Rolling Stones and U2 to religious events by such ministers as Billy Graham and T.D. Jakes.', 2, '2012-07-10 01:06:51', 'screenscrape', '2012-07-12 02:35:48', 'trdalyjr@gmail.com'),
(144, 'Bell Auditorium', '712 Telfair Street', 'Augusta', 23, 11, '30901', '(706) 724-24', 'http://www.augustaentertainmentcomplex.com/', '', 5, '2012-07-10 01:06:51', 'screenscrape', '2012-07-11 22:33:33', 'gbarnard'),
(145, 'Albany Civic Center Complex', '100 West Oglethorpe Boulevard', 'Albany', 24, 11, '31702', '(229) 317-72', 'http://www.albany.ga.us/content/1798/2879/2947/', 'The largest indoor municipal destination south of Atlanta, the Albany Civic Center is a uniquely designed multipurpose convention, entertainment, trade show and meeting facility.\r\n\r\nLocated at 100 W. Oglethorpe Blvd., the Albany Civic Center seats 10,240 people, has 46,000 square feet of exhibit space, 6,000 square feet of meeting space, and 2,100 parking spaces. Services include a full-service box office with Ticketmaster''s computerized system and a productive non-union stage crew.', 2, '2012-07-10 01:06:51', 'screenscrape', '2012-07-11 22:25:28', 'gbarnard'),
(146, 'Macon Centreplex', '200 Coliseum Drive', 'Macon', 25, 11, '31217', '478-751-9232', 'http://www.maconcentreplex.com/', '', 5, '2012-07-10 01:06:51', 'screenscrape', '2012-07-12 02:49:38', 'trdalyjr@gmail.com'),
(147, 'Citizens Bank Park', 'One Citizen''s Bank Way', 'Philadelphia', 26, 40, '19148', '215.218.5100', 'http://philadelphia.phillies.mlb.com/phi/ballpark/index.jsp', 'Citizens Bank Park is a 43,651-seat baseball park in Philadelphia, Pennsylvania, part of the South Philadelphia Sports Complex, and home of the Philadelphia Phillies.', 2, '2012-07-10 01:06:53', 'screenscrape', '2012-07-11 22:57:37', 'gbarnard'),
(148, 'Citi Field', '12001 Roosevelt Avenue', 'Flushing', 27, 33, '11368', '718.507.6387', 'http://newyork.mets.mlb.com/nym/ballpark/index.jsp', 'Citi Field is a stadium located in Flushing MeadowsCorona Park in the New York City borough of Queens. Completed in 2009, it is the home baseball park of Major League Baseball''s New York Mets.', 2, '2012-07-10 01:06:53', 'screenscrape', '2012-07-11 22:56:26', 'gbarnard'),
(149, 'Allstate Arena', '6920 N. Mannheim Road', 'Rosemont', 28, 14, '60018', '847.635.6601', 'http://www.allstatearena.com/', 'Opened in 1980 and operated by the Village of Rosemont, the Allstate Arena is a forward-thinking facility continuously striving to improve the fan experience and its environmental stewardship. It is conveniently located at the gateway to Chicago and its vast suburban residential areas, just minutes from the intersections of all major arterial expressways.\r\nWith a wide variety of events each year, the Allstate Arena is a place where everyone can enjoy quality family shows, riveting sports and mesmerizing musical performances.\r\nProud home to the Chicago Wolves (AHL), DePaul University Mens Basketball (Big East), Chicago Rush Arena Football (AFL) and the Chicago Sky (WNBA), regular shows include Ringling Brothers and Barnum & Bailey, World Wrestling Entertainment, Harlem Globetrotters, Stars on Ice and Disney on Ice. And the Allstate Arena is host to memorable musical guests such as Nickelback, Taylor Swift, Joan Sebastian, Fleetwood Mac, Britney Spears, Pink, Alicia Keys, Keith Urban and Metallica.\r\nWith an 18,500 reserved seating capacity and forty-eight luxury suites, the Allstate Arena is one of the largest indoor entertainment facilities in the Chicago area.\r\nExcellent sight lines from all seat locations, plenty of on-site parking and convenient public transportation unite to provide Allstate Arena''s guests with the ultimate fan experience. We look forward to sharing it with you!', 2, '2012-07-10 01:06:53', 'screenscrape', '2012-07-11 22:27:00', 'gbarnard'),
(150, 'Bankers Life Fieldhouse', '125 South Pennsylvania Street', 'Indianapolis', 29, 15, '46204', '(317) 917-25', 'http://www.bankerslifefieldhouse.com/', 'Bankers Life Fieldhouse is a multi-purpose arena located in downtown Indianapolis, Indiana, United States. Opened in November 1999 as Conseco Fieldhouse to replace Market Square Arena, it is home to the Indiana Pacers of the National Basketball Association and the Indiana Fever of the Women''s National Basketball Association. The Indiana Ice of the United States Hockey League also plays select games each year at Bankers Life Fieldhouse. The venue also hosts indoor concerts, college basketball games (including the annual Big Ten Conference tournaments) and many other events including the annual convention of the National FFA Organization, a youth organization.', 2, '2012-07-10 01:06:54', 'screenscrape', '2012-07-11 03:17:18', 'wsblejwas@gmail.com'),
(151, 'Frank Erwin Events Center', '1701 Red River Street', 'Austin', 30, 46, '78701', '512-471-7744', 'http://www.uterwincenter.com/', 'The Frank C. Erwin, Jr. Special Events Center, commonly known as Frank Erwin Center or UT Erwin Center, is a multipurpose arena on the campus of the University of Texas at Austin.', 2, '2012-07-10 01:06:54', 'screenscrape', '2012-07-12 02:34:29', 'trdalyjr@gmail.com'),
(152, 'AT&T Park', '24 Willie Mays Plaza', 'San Francisco', 31, 5, '94107', '415.972.2000', 'http://sanfrancisco.giants.mlb.com/sf/ballpark/index.jsp', 'AT&T Park, with its breathtaking views and classic design, was chosen as the 2008 Sports Facility of the Year by Sports Business Journal and Sports Business Daily as part of the inaugural Sports Business Awards program. The first privately financed ballpark in Major League Baseball since 1962, the Giants'' home has many incredible features.', 2, '2012-07-10 01:06:54', 'screenscrape', '2012-07-11 22:28:50', 'gbarnard'),
