(161, 'Atlanta Motor Speedway', '1500 Tara Place', 'Hampton', 1063, 11, '30228', '(770) 946-42', 'http://www.atlantamotorspeedway.com/', 'Atlanta Motor Speedway (formerly Atlanta International Raceway) is a track just outside Hampton, Georgia, twenty miles (32 km) south of Atlanta. It is a 1.54-mile (2.48 km) quad-oval track with a seating capacity of over 125,000. It opened in 1960 as a 1.5-mile (2.4 km) standard oval. In 1994, 46 condominiums were built over the northeastern side of the track. In 1997, to standardize the track with Speedway Motorsports'' other two 1.5-mile (2.4 km) ovals, the entire track was almost completely rebuilt. The frontstretch and backstretch were swapped, and the configuration of the track was changed from oval to quad-oval. The project made the track one of the fastest on the NASCAR circuit.', 13, '2012-07-10 01:06:56', 'screenscrape', '2012-07-11 22:32:06', 'gbarnard'),
