(171, 'Buckhead Theatre', '3110 Roswell Rd.', 'Atlanta', 1, 11, '30305', '404.843.2825', 'http://www.thebuckheadtheatre.com/', 'Originally opened in 1931, The Buckhead Theatre sits at the gateway to one of the countrys most storied neighborhoods. Two years of painstaking restoration led the way for a grand reopening in 2010, as The Buckhead Theatre reopened its doors as Atlantas premier intimate theatrical venue. Embracing the deep musical heritage of Georgia and the Southeast, The Buckhead Theatre has been the site of sold-out shows of every musical genre, rock, country, hip hop alternative, and more.\r\nCentral to Buckhead nightlife for more than 80 years, The Buckhead Theatre is steeped in the lively spirit of its history, yet fully modernized to accommodate todays various forms of entertainment and special events. The restored Spanish-Baroque architecture of this classic movie house jewel is a seamless historical counterpoint to the updated state-of-the-art lighting and sound system, modern catering kitchen, event space, and other amenities.\r\nBeyond the theatres 10-foot LED marquee, original Art Deco doorways lead from the lobby into the 8,000 square-foot main theatre and orchestra and loge spaces. The Buckhead Theatres revitalized interior plan increases flexibility for a variety of performances and events, including lectures, comedy, Broadway plays, concerts, and private and public events', 5, '2012-07-10 01:06:59', 'screenscrape', '2012-07-11 22:44:02', 'gbarnard'),
