(211, 'Aggie Stadium (North Carolina)', 'North Carolina A&T State University, 1601 East Market Stree', 'Greensboro', 53, 34, '27411', '336.334.7749', 'http://www.ncataggies.com/ViewArticle.dbml?DB_OEM_ID=24500&ATCLID=204934830', 'Aggie Stadium opened in 1981 and is considered one of the finest facilities in the Triad. It is also the second largest on-campus football facility in the Triad.\r\n\r\nIt serves as the home of the North Carolina A&T football team and fans have watched the team win more than 65 percent of its games there. From the first game that featured a 21-14 win over Triad rival Winston-Salem State in front of 23,000 fans until today, Aggie Stadium has served as a place to witness outstanding football, musical entertainment from the Blue and Gold Marching Machine and one of the best college environments in college football.', 2, '2012-07-10 01:14:03', 'screenscrape', '2012-07-11 02:35:14', 'wsblejwas@gmail.com'),
(212, 'Carolina Theatre - Greensboro', '310 S. Greene St.', 'Greensboro', 53, 34, '27401', '336-333-2605', 'http://www.carolinatheatre.com/', '', 5, '2012-07-10 01:14:03', 'screenscrape', '2012-07-11 22:45:40', 'trdalyjr@gmail.com'),
(213, 'North Carolina State Fair', '1025 Blue Ridge Blvd', 'Raleigh', 5, 34, '27607', '9197335079', 'http://www.ncstatefair.org/', '', 18, '2012-07-10 01:14:03', 'screenscrape', '2012-07-12 14:13:12', 'gbarnard'),
(214, 'O''Kelly Riddick Stadium (North Carolina)', '1801 Fayetteville St', 'Durham', 7, 34, '27707', '919-530-6721', 'http://www.durham-nc.com/planners/sports_events/okelly_stadium.php', '', 2, '2012-07-10 01:14:03', 'screenscrape', '2012-07-12 03:00:42', 'trdalyjr@gmail.com'),
(215, 'Pub 71', '4058 Peachtree Rd. NE', 'Atlanta', 1, 11, '30319', '404.467.8271', 'http://www.pub71.com/', '	Pub71 is an Irish Pub located on Peachtree Rd in Atlanta''s Brookhaven neighborhood. Founded in September 2006, PUB 71 features 18 beers on tap and 10-12 bottle selections that rotate monthly. We feature traditional Irish favorites like Fish and Chips, Shepherd''s Pie along with great appetizers, burgers, sandwiches and other specialty entrees. If you are looking for a warm friendly spot to watch your favorite game, see some great live music, play trivia, enjoy a great lunch, dinner, or a la carte brunch on the weekends than PUB 71 is the place for you. PUB 71  Where The Good Times Always Prevail.													', 12, '2012-07-12 18:44:31', 'gbarnard', NULL, NULL),
(216, 'Mellow Mushroom - Brookhaven', '4058 Peachtree Rd. NE', 'Atlanta', 1, 11, '30319', '404.266.1661', 'http://www.mellowmushroom.com/brookhaven', '		In 1974 three local college students, Marc Weinstein, Mike Nicholson and Earle Reeves decided to open up a different type of resturant - one that reflected their own eccentric philosophies, progressive values and relentless pursuit of quality. They purchased an old, beat up building on Spring Steet, near Georgia Tech, knowing that college kids, more than most, depend on two major food groups known as pizza and beer. Today, there are 100 Mellow Mushrooms spread across 15 states that share the DNAof that little hole in the wall on Spring Street. Each one locally-owned and operated, and every bit as unique and just a touch eccentric, as the original. "												', 1, '2012-07-12 18:46:57', 'gbarnard', NULL, NULL),
(217, 'Hudson Grille - Brookhaven', '4046 Peachtree Rd. NE', 'Atlanta', 1, 11, '30319', '404.233.0313', 'http://metrocafes.com/hudsongrille/Home.aspx', 'There''s a reason Hudson Grille is Atlanta''s best sports bar... PERIOD!  Our facilities are capable of handling parties into the hundreds.  You want a private room? Done.  You want a patio? Done.  How about an outdoor bar?  We''ve got it.  Need a big screen TV and audio/video equipment?  No problem, we''ve got you covered! Have an alumni group or fan club?  Bring them into Hudson Grille!', 7, '2012-07-12 18:49:53', 'gbarnard', '2012-07-12 18:50:15', 'gbarnard');
