(218, 'Kaleidoscope Bistro & Pub', '1410 Dresden Dr., Suite 100', 'Atlanta', 1, 11, '30319', '404.474.9600', 'http://www.k-pub.com/', 'Kaleidoscope Bistro & pub is a neighborhood place, nestled right in the heart of Brookhaven.  Our aim is to create a comfortable environment with great food, great beer, and great service, all at an affordable price.  We are committed to using only the highest quality ingredients, including antibiotic and hormone free proteins and produce from local farms. So please, come join us for a meal, a drink, or just to hang out with your friends and neighbors!														', 8, '2012-07-12 18:52:18', 'gbarnard', NULL, NULL),
(219, 'Verde Taqueria', '1426 Dresden Dr.', 'Atlanta', 1, 11, '30319', '404.254.5319', 'http://verdetacos.com/tacos/', 'Four friends and restaurant veterans  Alex, Freddy, Hil and Pat  opened the doors at Verde to the Brookhaven neighborhood in the spring of 2009. Their vision for the new restaurant was simple enough: open a local spot that would be fun and relaxed, perfect for families, friends, date-nights or just a neighborly drink. Stop by pretty much any day of the week and you can see that vision brought to life with plenty of fresh food, cool drinks and relaxed conversation flowing.\r\nLike any good local place, at Verde we want to make sure everyone who walks in feels a familiarity and a sense of ownership  like this is your neighborhood place. At Verde, youre always welcome and always have a say in how things are run. Think of us as the neighbors that happen to be excellent social hosts, and our restaurant as our great big house where we have everyone over to eat and drink our latest concoctions.\r\nSo, whether youre looking for a little privacy in a comfy booth or a big patio full of friends and sunshine, were your place in the neighborhood for fresh tastes, and local flavor.														', 1, '2012-07-12 18:53:11', 'gbarnard', NULL, NULL),
(220, 'The Bat & Ball Pub', '2150 B Johson Ferry Rd. ', 'Atlanta', 1, 11, '30319', '770.986.0410', 'http://www.dunwoodyrestaurantgroup.com/the-bat-ball-pub.aspx', 'The Bat and Ball is of course named after the game of cricket that was first played in Hambledon, Hampshire. It is a very intriguing game that is played around the world in countries that have close ties to the British Empire or Commonwealth of Nations.                                                                                                                                                                                                             Located in an up and coming trendy area this pub is located in an old brick building at the intersection of Ashford-Dunwoody Road and Johnson Ferry next to the old movie theatre. We are just south of Blackburn Park that was the barracks during World War I and II for the army who used it as the take off point from there to Chamblee Airport (now known as Peachtree Dekalb Airport) and then on to Europe.\r\nThe Pub offers both traditional English foods and classic American favourites that are already recognized across our other Pubs by many loyal customers. Enjoy a pint and a sandwich on the patio or some lively conversation at the bar!\r\nWe believe in ''snugness not smugness'' and want you to feel that this is part of your neighbourhood and after all we all need our ''local''!', 12, '2012-07-12 18:54:05', 'gbarnard', '2012-07-12 18:55:08', 'gbarnard'),
(221, 'Noche - Brookhaven', '705 Town Blvd.', 'Atlanta', 1, 11, '30319', '404.364.9448', 'http://www.h2sr.com/noche-brookhaven/', '		Noche Tequila and Tapas Bar now open in Town Brookhaven shopping center on Peachtree Street next to Oglethorpe University. Open 7 days a week for lunch, dinner & open late night! Enjoy the high energy bar as you sip on our world famous margaritas & our amazing Spanish tapas! 												', 1, '2012-07-12 18:56:09', 'gbarnard', NULL, NULL),
(222, 'Slack''s', '305 Brookhaven Ave., Suite B1250', 'Atlanta', 1, 11, '30319', '404.602.5558', 'http://www.slacksatlanta.com/', 'The menu offers a taste of Philadelphia that includes Yuengling beers, Amoroso rolls, house recipe hoagie oils and both Giordano and Berks meats. All wing sauces are made on premises and we hand bread all tenders, wings and calamari. \r\n\r\nCome enjoy a taste of Philly along with a full service bar, offering a large selection of beers, wines and spirits. Join us to experience excellent food at our stylish dining room or enjoy a cocktail crafted by our bartenders at our uniquely designed bar.', 7, '2012-07-12 18:57:48', 'gbarnard', '2012-07-12 18:58:00', 'gbarnard'),
