(261, 'St Regis Bar', '88 W Paces Ferry Rd', 'Atlanta', 1, 11, '30305', '404-563-7900', 'http://www.stregisatlanta.com/stregis-bar', 'Just as the King Cole Bar in New York is known for its famous mural, The St. Regis Bar in Atlanta features an original mural of a Phoenix rising from the ashes. Here, hotel guests and Atlanta locals recognize The St. Regis Bar as a convivial gathering place for creative cocktails, favorite classics and memorable food pairings in a luxuriously relaxed environment.', 12, '2012-07-14 22:12:39', 'trdalyjr@gmail.com', '2012-07-14 22:13:29', 'trdalyjr@gmail.com'),
