(284, 'AMC Fork and Screen', '3340 Peachtree Rd. Ne', 'Atlanta', 1, 11, '30326', '404.467.9619', 'http://www.amctheatres.com/movie-theatres/amc-fork-screen-buckhead', 'Fork & Screen is a movie theatre and a casual restaurant rolled into one with upgraded seats, an extensive menu, full cocktail bar and service at the push of a button.\r\n\r\nCombine dinner and a movie for a fantastic date night or girls'' night out. Its also great for families as long as all guests under the age of 18 are accompanied by an adult.\r\n\r\nYou''ll love the delicious food on the menu and the friendly, unobtrusive service. Once you try Fork & Screen, you may never want to see a movie any other way.', 15, '2012-07-15 17:38:01', 'trdalyjr@gmail.com', '2012-07-16 23:45:14', 'trdalyjr@gmail.com'),
