(286, 'Hal''s', '30 Old Ivy Rd Ne', 'Atlanta', 1, 11, '30342', '404-261-0025', 'http://hals.net/', 'With a taste for every palette, Hal''s menu is bold, rich and extensive. From fresh seafood and pasta to veal, lamb and fish, the selection is diverse-yet consistent in its quality and purposeful in its ensemble. The food is prepared with exceptional care, with hints of Creole and Italian influence that are both subtle and distinctive-never compromising taste for form. And it is served by a career wait staff who are knowledgeable, professional, and as often requested by name as the dishes they serve.', 1, '2012-07-15 17:42:20', 'trdalyjr@gmail.com', '2012-07-15 17:42:37', 'trdalyjr@gmail.com'),
