(332, 'Limerick Junction Pub', '822 N. Highland Ave. ', 'Atlanta ', 1, 11, '30306', '404.874.7147', 'www.limerickjunctionpub.com', '														', 12, '2012-07-16 15:35:42', 'magannjohnson@gmail.com', NULL, NULL),
(333, 'Brick Store Pub', '125 E Ct Sq', 'Decatur', 3, 11, '30030', '404.687.0990', 'http://www.brickstorepub.com', 'The Brick Store Pub opened on June 27, 1997 at 9pm. Three friends from Athens, Georgia (Dave Blanchard, Mike Gallagher and Tom Moore) wanted, like so many others with a degree and no idea what to do with it, to own their own pub. Having worked in the bar/restaurant business for a combined 20+ years in Athens and Atlanta, they realized a niche had yet to be filled  a neighborhood pub where conversation dominates, pints are served properly and in the appropriate glassware, service is friendly and knowledgeable and the food is made from scratch every day, all accented by a beautiful historic building located on a bustling town square.	\r\n\r\nPatrons come for all that we passionately offer but also because we provide an environment that boasts no televisions, no neon, no obnoxious music and no major domestic beers. What you find at our main bar are local, regional and nationally acclaimed American craft beers, German and English specialty beers and our vintage and reserve bottled beer list. We frequently rotate a carefully chosen array of 17 draught and 75 bottled beers.\r\nIn 2004, House Bill 645 brought an end to Georgias 6% A.B.V. (alcohol by volume) law and allowed beers up to 14% to be sold in the state. This was the catalyst for our Belgian Room, a cozy host to all the new and amazing we beers we could offer and the beer lovers who were eagerly awaiting their arrival. Upstairs and to the left is where you will find the Belgian Beer Bar, featuring 8 rotating draughts and over 120 Belgian/Belgian-style bottled beers. Our relationship with importers and breweries allows us to offer beers you will find nowhere else. The Brick Store and its exclusive beer list have received national & international acclaim on the worlds two biggest beer websites Beeradvocate.com & Ratebeer.com. Weve also racked up ten consecutive years of Best of Atlanta recognition for our fabulous beer list and pub fare.\r\nThe Brick Store is firmly established as the hub for residents of the City of Decatur and surrounding neighborhoods. Those seeking a salt-of-the-earth hangout will find sheer happiness at The Brick Store Pub, a local to truly call ones own. Cheers!', 12, '2012-07-16 19:51:02', 'grayson', '2012-07-16 19:51:35', 'grayson'),
(334, 'Eddie''s Attic', '515-B N McDonough St', 'Decatur', 3, 11, '30030', '404.377.4976', 'www.eddiesattic.com/', 'Eddie''s Attic is a popular and intimate live music venue for aspiring and accomplished performing songwriters.  Located in Decatur, Georgia a small, artist-friendly town within the metro Atlanta area - a cultural blend of Berkeley and Mayberry.  A "listening room" with a superior sound system/acoustics, where customers are asked to silence cell phones and actually listen to the songs, has made the Attic''s music room a hit with music enthusiasts.  Eddie''s Attic draws both fans and artists from all over the world, and continues to be one of the premier music venues in the South.  On any given night, music lovers can hear talented performing songwriters and bands playing original music in an intimate setting.  The Attic welcomes all varieties of original, live music and embraces the diversity that allows independent music to thrive.													', 12, '2012-07-16 19:54:18', 'grayson', NULL, NULL),
(335, 'Trackside Tavern', '313 E College Ave.', 'Decatur', 3, 11, '30030', '404.378.0504', 'http://www.tracksidetavern.com/', '														', 12, '2012-07-16 19:55:49', 'grayson', NULL, NULL),
(336, 'Steinbeck''s', '659 E Lake Dr.', 'Decatur', 3, 11, '30030', '404.373.1116', 'http://www.steinbecksbar.com/', 'The idea behind Steinbecks started four years ago in the cinque terra region of Italy, with a lovely meal at a small independent trattoria. Chalkboards lined the walls. The lack of care with which they listed their specials was diametrically opposed to the evident love that was in each dish. When the dish sold out, it was erased and the restaurant moved on with whatever was next. That commitment to freshness and constant change underlines what we expect of Steinbecks. We dont have a theme nor a blueprint other than constant quality of service, food and drink. Welcome!														', 12, '2012-07-16 20:05:09', 'grayson', NULL, NULL),
(337, 'The Pinewood', '254 W Ponce De Leon Ave', 'Decatur', 3, 11, '30030', '404.373.5507', 'http://www.pinewoodtr.com', '														', 12, '2012-07-16 20:06:16', 'grayson', NULL, NULL),
(338, 'The Marlay House', '426 W Ponce De Leon Ave', 'Decatur', 3, 11, '30030', '404.270.9950', 'http://www.themarlayhouse.com', 'The Marlay House is an authentic Irish owner operated Dublin style pub located in Decatur, Georgia. Its a place where friends and family can go for a meal and a pint surrounded by traditional decor combined with a contemporary welcoming Irish atmosphere. The Marlay blends the owners Irish heritage with their current lives in Decatur. We have an extensive beer selection, top tier pub grub alongside seasonal specials with local produce. Check our events section for upcoming food and beer pairing events.\r\n\r\nRegular Opening Hours  Daily at 11.30am with Brunch served from 10.30am to 3pm on Saturdays and Sundays.\r\nMonday to Thursday the pub closes at Midnight (Kitchen closes 10.30p) & Friday and Saturday the pub closes 2am (Kitchen closes 11.30pm).\r\n\r\nMany of you knew us as The Grange Public House but as of January 31, 2010 we changed our name to The Marlay House. It is a sordid tale but we decided, just like David La Touche did in Rathfarnham, Co. Dublin Dublin in 1764, to change The Grange into The Marlay. We have the same Irish ownership.													', 12, '2012-07-16 20:08:02', 'grayson', NULL, NULL),
(339, 'Mac McGee', '111 Sycamore St.', 'Decatur', 3, 11, '30030', '404.377.8050', 'http:/macmcgeeirishpub.com/', '	Mac McGee opened its doors to Decatur, GA at the start of January 2010. Located on Decaturs square, it beckons coziness with a first class welcome. Whether youre alone or in a group, you will feel like a friend as well as a patron in Mac McGee.\r\n\r\nWe pride ourselves on the traditional aspects of Irish pub culture. In alliance our chef has cultivated a menu for Irish cuisine with a twist! Our staff members are more like a family that will offer you a dose of craic to complement that pint or meal. 													', 12, '2012-07-16 20:38:17', 'grayson', NULL, NULL),
(340, 'The Corner Pub', '627 E College Ave', 'Decatur', 3, 11, '30030', '404.377.0603', 'http://www.pubalicious.com', 'The Corner Pub makes its home in East Decatur Station, an urban industrial chic mixed-use complex on East College Avenue within walking distance of the Avondale MARTA Station. Steel and glass outside; warm, rich wood and smiles inside.\r\n\r\nThe pub redefines the fine food and cordiality of its former Oakhurst location. Owners Joshua and Bethy Elrod see a new in-town neighborhood putting down roots around the pub. They look forward to seeing old friends and patrons and meeting new ones.\r\n\r\n\r\nThink of The Corner Pub as you plan parties and gatherings at the pub or for take away Corner Pub Decatur.', 12, '2012-07-16 20:40:01', 'grayson', '2012-07-16 20:40:45', 'grayson'),
(341, 'The Square Pub', '115 Sycamore St', 'Decatur', 3, 11, '30030', '404.844.4010', 'http://squarepubdecatur.com/spd/Home.html', '	The Square Pub was opened by two life-long restaurant guys, Jason and Bob. We both like great food, craft beer, sports, and laid back places to get all three. We met working together and decided later that, after years of working for other people, we wanted to have our own place. In a nutshell we have created the type of place where we would hang out. \r\n\r\nOur menu includes your normal pub fare like burgers, wings and nachos but you will also find specials like ossobucco, steak or duck from time to time. You will also find a number of southwest influenced dishes such as a green chile cheeseburger or fried avocado that are influenced by Jasons 10 years in New Mexico. Yes it is real green chile and Yes it is from Hatch. No matter what youre in the mood for we strive to provide a higher quality of food than you might expect to find in a pub setting. Id rather eat in a bar than drink in a restaurant. \r\n\r\nWe strive to provide an exceptional beer selection as well. Bob has been a home-brewer for years. That combined with over 20 years in the beer business and a general all around love of frosty beverages has turned him into quite the beer pro. We go with the no crap on tap philosophy and reserve our draughts for craft beers. With 19 taps and 35 bottles we are able to provide something for most every taste. 4 taps rotate seasonally and 4 others rotate with whatever is new and exciting or just plain good.													', 12, '2012-07-16 20:41:52', 'grayson', NULL, NULL),
(342, 'Mezcalito''s Cantina', '653 E Lake Dr.', 'Decatur', 3, 11, '30036', '404.687.0007', 'http:/www.mezcalitoscantina.com', '	Located in the heart of Oakhurst Square in Decatur, Mezcalito''s Cantina takes authentic Mexican cuisine and prepares it with a twist!\r\nOur menu features appetizers, salads, soups, quesadillas, enchiladas, tacos and a variety of original specialities.\r\nDaily authentic specials from the south of Mexico from pozole to different kind of moles. Beer selections from Pacifico to Palma Loca, a Brazilian beer, complete the experience. Visit us today.													', 1, '2012-07-16 20:43:14', 'grayson', NULL, NULL),
(343, 'Twain''s Billiards & Tap', '211 E Trinity Pl', 'Decatur', 3, 11, '30030', '404.373.0063', 'http://www.twains.net/', '	We are a full service brewpub, restaurant, and poolhall located in downtown Decatur, GA. Open since 1996, we have been brewing our own crafted ales since November 2006. Join us soon for a pint or two, some fresh, tasty grub, and few friendly games. We look forward to seeing you!										', 1, '2012-07-16 20:48:34', 'grayson', NULL, NULL),
(344, 'McGowan''s Oakhurst Pub', '321 W Hill St', 'Decatur', 3, 11, '30030', '404.373.4702', 'http://www.mcgowansoakhurstpub.com', '														', 12, '2012-07-16 20:50:45', 'grayson', NULL, NULL),
(345, 'Taco Mac - Decatur', '240 W Ponce De Leon Ave', 'Decatur', 3, 11, '30030', '404.378.4140', 'http://tacomac.com/', '	What is the deal with the name? Why do we have the name of what appears to be a Mexican restaurant, when we have the best places to drink beer, watch a game, and get the southeasts original Buffalo-style chicken wings? Well, it is not a long story, so if you are one of those people who have always wondered about the name, here goes:\r\nIn 1979, a couple of guys from Buffalo made a stop in Atlanta on the way to Florida. Turns out that they liked Atlanta, and decided to stay. They had bigger ideas than they had bank accounts, but eventually found a spot to open their restaurant. The idea was to offer Buffalostyle chicken wingssomething totally new in the southin a relaxing, neighborhood pub setting. What they found was a little taco stand on the corner of Virginia and North Highland Avenues. The rest, as they say, is history.\r\nWhat happened next, so many years ago, is the critical piece to the story. When these guys finally had a few bucks, it was time to change the sign out front to somethinganythingother than Taco Mac. But they also had some badly needed kitchen repairs to address. So the sign stayed. And this went on, until eventually everyone in the neighborhood knew the beer and wing place, their favorite little hang-out, as Taco Mac. You can still visit the original location in the heart of Virginia-Highland, just miles from downtown Atlanta. It still has the original sign, and the clock that always reads seven oclock. But the clock is another story.\r\nAs the founders grew a bit older, some old friends came down to help open new locations. Taco Mac began to take on a slightly different identity, but always staying true to its roots. The menu expanded, the beer selection grew (and grew, and grew), and Taco Mac became a more family-friendly atmosphere. Now we are proud to have over 25 locations across three states. Taco Mac offers an incredible beer selection, the best TV set-up anywhere, and a food menu that includes something for everyone. We still sell the southeasts original Buffalo-style chicken wings, and yes, we have tacos.\r\nAt the heart of it all is that we love what we do. We like to get a bite to eat with friends and family in a fun atmosphere. We enjoy a beer or two while were watching a game. So sit back, relax, and see if Taco Mac isnt right up your alley too. Were glad youre here.													', 1, '2012-07-16 20:52:13', 'grayson', NULL, NULL);
