(346, 'Mojo Pizza n Pub', '657 East Lake Drive', 'Decatur', 3, 11, '30030', '404.373.1999', 'http://www.mojopizzaNpub.com', 'Opening in June of 1998, Mojo Pizza N Pub was the first restaurant to open in the Oakhurst neighborhood since the 1970s.  Mojo Pizza prides itself on making the finest NY style thin crust pizza with its homemade sauce and signature sesame seed crust.  The dough is made fresh daily and baked on the stone.\r\n\r\nWe are open 7 days a week and have trivia on Wednesday nights starting at 7:30 pm.\r\n\r\nWe are very kid friendlyrelax and enjoy a beer while the kids play at one of our many video games.\r\n\r\nBe sure to check out our big patio out front (and bring your dog!)!\r\n\r\nWe are now a full service restaurant. Just take a seat and well be right with you.													', 1, '2012-07-16 20:53:59', 'grayson', NULL, NULL),
(347, 'The Original Chocolate Bar', '201 W Ponce De Leon Ave', 'Decatur', 3, 11, '30030', '404.378.0630', 'http://thechocolatebardecatur.com/', '														', 1, '2012-07-16 20:55:37', 'grayson', NULL, NULL),
(348, 'Sawicki''s', '250 W Ponce De Leon Ave', 'Decatur', 3, 11, '30030', '404.377.0992', 'http://sawickisfoods.com/', 'Since 2007, Sawickis Meat, Seafood and More in downtown Decatur, Georgia has been selling only the finest artisanal and local products. Lynne Sawickis culinary background spans 27 years in the Atlanta area. Lynne brings her extensive experience as a chef to her store to offer you a wide variety of salumi, fresh meats and seafood, organic produce as well as local cheeses.\r\n\r\nPrepared foods as well as an awesome sandwich assortment for lunch round out a from scratch bakery case. Sawickis now has available their Farm to Table take out dinners for 2 or great suggestions for helping you cook your own Five Star dinner!\r\n\r\nWe welcome any custom ordering you might need for any event or Holiday. Most products are available the next day, so if you need a suckling pig, oysters or even Foie gras  for your next party give us a call.\r\n\r\nWe can also cater your wedding, cook a Five Star dinner in your house or bring sandwich platters to your next meeting.													', 1, '2012-07-16 20:57:43', 'grayson', NULL, NULL),
(349, 'Aria', '490 East Paces Ferry', 'Atlanta', 1, 11, '30305', '404.233.7673', 'http://www.aria-atl.com/', 'Klaskalas avant-garde take on fine American cuisine will leave you fulfilled and intrigued every visit. The freshest and highest-quality ingredients arrive daily and culminate into dishes that are simple, yet refined. The kitchens sophisticated creativity warrants high praise and recognition.  Many of the meats are braised, roasted, stewed, or simmered for long periods of time generating the perfect flavor.  Klaskalas culinary talent is recognized nationwide, earning him numerous awards. Most notably, in 2001, Klaskala was one of six chefs who were awarded the Robert Mondavi Culinary Award of Excellence. The Atlanta Journal Constitution notes that Aria is a melodic mix of hot trends and hearty fare.  Signature dishes include the Warm Lobster Cocktail, the Niman Ranch Slow Roasted Pork, and the Zinfandel Braised Beef Short Rib. Guests typically order at least one of the award-winning desserts prepared by outstanding Pastry Chef Kathryn King. Favorites include the Cross Creek Tangerine Panna Cotta, the Fresh Sorbets, and the Warm Chocolate Cheesecake.', 1, '2012-07-16 23:47:27', 'trdalyjr@gmail.com', '2012-07-16 23:47:47', 'trdalyjr@gmail.com'),
