(355, 'Cafe at Pharr-Buckhead', '3145 Peachtree Road', 'Atlanta', 1, 11, '30305', '404.238.9288', 'http://cafeatpharr.com/', '			Thanks for checking out The Cafe at Pharr. Established in 1993, the simply satisfying cafe has been serving Atlanta for well over a decade. Our lowfat menu has brought the health conscious Atlantans a fast and friendly place to go!											', 1, '2012-07-16 23:57:31', 'trdalyjr@gmail.com', NULL, NULL),
