(357, 'Antica Posta', '519 E. Paces Ferry Rd., N.E.', 'Atlanta', 1, 11, '30305', '404.262.7112', 'http://www.anticaposta.com/', 'Antica Posta offers quintessential Tuscan cooking. Open nightly for dinner, the exhibition kitchen features Tuscan specialties, signature meat and fish dishes, homemade pastas and breads, and delicious appetizers. Antica Posta''s cozy dining rooms and elegant Bar and Lounge beckon diners to experience a touch of Tuscany nestled in the archetype Buckhead!', 1, '2012-07-16 23:59:57', 'trdalyjr@gmail.com', '2012-07-17 00:00:21', 'trdalyjr@gmail.com'),
