(370, 'New York Prime', '3424 Peachtree Rd NE', 'Atlanta', 1, 11, '30326', '404.846.0644', 'http://www.centraarchy.com/newyorkprime_Atl.php', '	Voted "Best Steakhouse" 2003-2012 by Jezebel Magazine, "1 of 1400 Top Restaurants in the World" 2011 by Zagat and OpenTable diners'' choice winner, New York Prime has crafted a loud, lively social niche for ladies and gents alike.  Sip colorful cocktails or have a stiff drink and enjoy a USDA prime steak, chilled Carpaccio or fresh Florida Stone Crabs; for dessert, share a gigantic table sized Chocolate Cake.  Located in the heart of Buckhead at Monarch Tower; offering live entertainment nightly and seasonal Courtyard dining.													', 1, '2012-07-17 01:07:02', 'trdalyjr', NULL, NULL),
