(395, 'Dave Poe''s BBQ', '660 Whitlock Avenue', 'Marietta', 4, 11, '30064', '770.792.2272', 'http://www.davepoes.com/', 'For over 30 years, Dave Poes has been providing the very best in down home BBQ goodness. Our Award winning Que has covered the southeast pleasing the most sophisticated BBQ connoisseurs. Over the years we have had the honor of feeding everyone from the U.S. Senate to Charlie Daniels; from Coca-Cola to the Atlanta Symphony, Vince Dooley and everyone in between.', 1, '2012-07-17 01:50:27', 'wsblejwas@gmail.com', '2012-07-17 01:50:59', 'wsblejwas@gmail.com'),
