(405, 'Australian Bakery', '48 South Park Square', 'Marietta', 4, 11, '30060', '678.797.6222', 'http://australianbakerycafe.com/', 'The Australian outback country town of Boort is a long way from the big smoke of Atlanta, Georgia. In fact, its a long way from anywhere. But off the beaten path, over 155 miles from Melbourne (could say over 560 miles from Sydney), is where the owners and origins of the Australian Bakery Cafe can be traced and where, in the same hospital in Boort, two life-long mates were born 3 weeks apart.', 1, '2012-07-17 02:02:22', 'wsblejwas@gmail.com', '2012-07-17 02:02:29', 'wsblejwas@gmail.com'),
