(445, 'Tommy''s Sandwich Shop', '148 Roswell Street SE', 'Marietta', 4, 11, '30060', '770.422.3185', 'http://www.tommyssandwichshop.com/', 'Much of the Square has changed over the years, but just like our opening day in 1977, you''ll still find Tommy behind the counter making your sandwich just how you like it. Whether you are in need of a light breakfast to start your day or have a hankering for our world famous chicken salad and a sweet iced tea made fresh every morning, there are plenty of reasons to stop by Tommy''s and say hello.', 1, '2012-07-17 02:39:27', 'wsblejwas@gmail.com', '2012-07-17 02:39:37', 'wsblejwas@gmail.com'),
