(452, 'Cafe Prego', '4279 Roswell Rd NE # 101', 'Atlanta', 1, 11, '30342', '404.252.0032', 'http://cafeprego.net/', '														CAF PREGO is a little charming Italian restaurant located between North Buckhead & South Sandy Springs exactly in the chastain-Square shopping-center. Caf Prego is owned and operated by Gus and family. Gus has had years of experience in the Italian food business and management. We pay close attention to the quality and detail of our food while supervising all restaurant operations closely.  ', 1, '2012-07-17 02:47:29', 'trdalyjr', NULL, NULL),
