(472, 'North Fulton Golf Course', '216 W Wieuca Rd NW', 'Atlanta', 1, 11, '30342', '404.255.0723', 'http://www.americangolf.com/north-fulton-golf-course', 'North Fulton Course was first designed in 1937 by Chandler Egan in collaboration with Walter Hagen and Atlanta''s greatest golfer, Bobby Jones. Located in the heart of Chastain Park, Atlanta''s largest park, North Fulton Golf Course is situated on the site of an ancient Creek Indian Village. The golf course is also formerly home of a pre-Masters PGA Tournament and the National Public Links Tournament. Consistently rated Atlanta''s top public course, North Fulton features a scenic view of the Buckhead skyline that can be seen from many of its rolling fairways. The par 4, 446-yard No.18 is one of the most difficult holes in Atlanta that requires a well-placed tee shot down a narrow fairway with a creek looming on the left. The second shot presents an uphill strike to an undulating green with a bunker guarding closely on the left. Come to North Fulton Golf course to enjoy the great scenery, the storied history, and a great round of golf.', 16, '2012-07-18 01:10:20', 'trdalyjr', '2012-07-18 01:12:02', 'trdalyjr'),
(473, 'Browns Mill Golf Course', '480 Cleveland Ave SE', 'Atlanta', 1, 11, '30354', '404.366.3573', 'http://www.americangolf.com/browns-mill-golf-course', 'Browns Mill Golf Course was originally designed by George Cobb, who designed the par three course at Augusta National. Conveniently located, Browns Mill is only 10 minutes from downtown Atlanta. The 18 hole, open design course measures 6500 yards. The front nine offers three small lakes that will occasionally grab a wayward ball. The signature hole on the front nine is a 435-yard par-4 with a thirty degree incline from tee to green. Many golfers walk away from this one with a bogey and a smile. The signature hole on the back is a 213-yard par-3 with some incline. This is followed by two 400-yard par-4s that will test your driving accuracy.', 16, '2012-07-18 01:16:42', 'trdalyjr', '2012-07-18 01:17:02', 'trdalyjr'),
(474, 'Bobby  Jones Golf Course', '384 Woodward Way', 'Atlanta', 1, 11, '30305', '404.355.1009', 'http://www.bobbyjonesgolfclub.com/', '		Bobby Jones Golf Course, recently renovated with new Champion Bermuda greens, is an 18 hole public golf course that rests in the heart of Buckhead and just ten minutes from downtown Atlanta. Built in 1932, this John Van Kleek design has a rich history dating back to the Civil War. The Battle of Peachtree Creek, one of the most pivotal battles of the Civil War, took place in the valley of the golf course surrounding the clubhouse. Today, Peachtree Battle Creek meanders through this tree-lined par 71 championship golf course and comes into play on five of the eighteen holes. Elevated tees on many of our holes offer scenic views of the midtown Atlanta skyline. The tightly placed greens offer a challenging round for the skilled golfer, while the open fairways create a pleasant round for golfers of all skill levels.\r\n     Please note, in an effort to speed up play and make everyone''s round more enjoyable, we ask that everyone plays ready golf  and also stays within one shot of the group ahead of them.  We ask this to ensure a pace of play of 4 Hours and 1 Minute for 18 holes.												', 16, '2012-07-18 01:21:24', 'trdalyjr', NULL, NULL),
(475, 'Piedmont Driving Club', '4405 Camp Creek Parkway', 'Atlanta', 1, 11, '30331', '404.875.2566', 'http://drivingclub.com/default.aspx', '														 Since 1887, the Piedmont Driving Club has enjoyed a reputation as one of the most prestigious private clubs in the South.   In keeping with its original purpose - the promotion of recreation and enjoyment for its members and their families - the Club provides outstanding athletic facilities to meet the desires of the membership for golf, tennis, swimming, squash, and fitness activities. Now in our second century, the Piedmont Driving Club continues to grow and is a dynamic part of Atlanta''s rich heritage and promising future.', 16, '2012-07-18 01:24:27', 'trdalyjr', NULL, NULL),
(476, 'Charlie Yates Golf Course', '10 Lakeside Village Dr SE', 'Atlanta', 1, 11, '30317', '404.373.4655', 'http://www.charlieyatesgolfcourse.com/sites/courses/layout9.asp?id=343&page=8653', 'Located just four miles from downtown Atlanta, \r\nThe Charlie Yates Golf Course at East Lake is an \r\n18-hole, Par 58, mid-length course with Bermuda \r\nfairways and Bent grass greens.\r\n\r\nDesigned by famed golf course architect Rees Jones, \r\nThe Yates Course offers a mix of challenging Par 3''s \r\nand 4''s with remarkable views of the downtown Atlanta skyline.', 16, '2012-07-18 01:26:28', 'trdalyjr', '2012-07-18 01:26:40', 'trdalyjr'),
(477, 'Wolf Creek Golf Course', '3000 Union Rd SW', 'Atlanta', 1, 11, '30331', '404.344.1334', 'http://www.wolfcreekgc.com/', 'We are the official golf course of the new Golfsmith''s in Cumberland Mall.\r\n\r\nPlay anytime on Friday and get a $10.00 coupon for GolfSmith''s.  Also on Friday,  golfers get a $10.00 discount on all merchandise purchases.  Thats a total of $20.00 just for playing on Friday.  Start the weekend early.\r\n\r\nAll of our rounds are "All you can play".  So start early and play 36 or more holes.', 16, '2012-07-18 01:27:57', 'trdalyjr', '2012-07-18 01:28:08', 'trdalyjr'),
(478, 'Candler Park Golf Course', '585 Candler Park Dr NE', 'Atlanta', 1, 11, '30307', '404.371.1260', 'http://www.americangolf.com/candler-park-golf-course', '														Candler Park Golf Course is a unique 9 hole executive course located in the heart of downtown Atlanta, near the Little Five Points and Virginia-Highlands areas.  There are four par 4''s and five par 3''s.  We are currently a walking only facility with pull carts available for rent.', 16, '2012-07-18 01:29:26', 'trdalyjr', NULL, NULL),
(479, 'Druid Hills Golf Course', '740 Clifton Rd NE', 'Atlanta', 1, 11, '30307', '404.377.1768', 'http://www.dhgc.org/Club/Scripts/Home/home.asp', '														Tucked away in the historic Druid Hills neighborhood, our members consider their club a sanctuary just minutes away from downtown Atlanta.\r\n\r\nEstablished in 1912, Druid Hills has long offered the full array of services expected in today''s modern private club. \r\n\r\nA day at Druid Hills offers a chance to golf, play tennis, swim or work out in our first class fitness center. For dinner, our three dining rooms offer the opportunity to sample cuisine often referred to as "The best kept dining secret in Atlanta".', 16, '2012-07-18 01:30:54', 'trdalyjr', NULL, NULL),
(480, 'Ansley Golf Club-Midtown', '196 Montgomery Ferry Drive', 'Atlanta', 1, 11, '30309', '404.875.1687', 'http://www.ansleygolfclub.org/home/', '														Ansley members enjoy two first-rate locations and clubhouses; a premier, historic midtown site in Ansley Park, along with the suburban location that is home to Ansley''s nationally recognized championship golf course, Settindown.\r\n\r\nAnsley Golf Club is considered the most family oriented, friendly, and fun private Country Club in Atlanta, with formal and casual dining, swimming, tennis, fitness, youth programs, and twenty-seven of the most picturesque and demanding holes in the world of southern golf.\r\n\r\nWhat started out as an amenity to a real estate venture in the early 1900s has, over the years, evolved to become one of Atlantas premier in-town and suburban clubs.', 16, '2012-07-18 01:41:03', 'trdalyjr', NULL, NULL),
(481, 'Ansley Golf Club-Settindown', '5500 Settindown Drive', 'Roswell', 66, 11, '30075', '770.640.4620', 'http://www.ansleygolfclub.org/home/', 'Ansley members enjoy two first-rate locations and clubhouses; a premier, historic midtown site in Ansley Park, along with the suburban location that is home to Ansley''s nationally recognized championship golf course, Settindown.\r\n\r\nAnsley Golf Club is considered the most family oriented, friendly, and fun private Country Club in Atlanta, with formal and casual dining, swimming, tennis, fitness, youth programs, and twenty-seven of the most picturesque and demanding holes in the world of southern golf.\r\n\r\nWhat started out as an amenity to a real estate venture in the early 1900s has, over the years, evolved to become one of Atlantas premier in-town and suburban clubs.', 16, '2012-07-18 01:42:11', 'trdalyjr', '2012-07-18 01:42:38', 'trdalyjr'),
(482, 'Cross Creek Golf Club', '1221 Cross Creek Parkway', 'Atlanta', 1, 11, '30327', '404.351.7600', 'http://www.crosscreek-atlanta.com/sub_category_list.asp?category=5&title=Golf+Club', 'Our Par 3, 18-hole golf course is hidden in the middle of Buckhead.  Surrounded by the luxurious neighborhood and lush landscaping it makes a perfect get-away for anytime of the day.\r\n\r\nOnsite you''ll find a bar and cafe with a beautiful veiw of the course, a Proshop, and Robie Robinson, Golf Pro.  Robie is available for lessons for all age groups or to give pointers about your handicaps.\r\n\r\nThere''s no need to call ahead for a tee time, come as you are and bring a few friends - with prices ranging from $15-$22.', 16, '2012-07-18 01:45:33', 'trdalyjr', '2012-07-18 01:49:06', 'trdalyjr'),
(483, 'Capital City Club - Brookhaven/Country Club', '53 West Brookhaven Drive, N.E. ', 'Atlanta', 1, 11, '30319', '404.233.2121', 'http://www.capitalcityclub.org/Default.aspx?p=DynamicModule&PageId=306010&ssid=193205&vnf=1', '														', 16, '2012-07-18 01:52:58', 'trdalyjr', NULL, NULL),
(484, 'Peachtree Golf Club', '4600 Peachtree Road ', 'Atlanta', 1, 11, '30319', '404.233.4428', '', '', 16, '2012-07-18 01:54:29', 'trdalyjr', '2012-07-18 01:55:25', 'trdalyjr');
INSERT INTO `venues` (`id`, `name`, `address`, `city`, `cityId`, `stateId`, `zip`, `phone`, `website`, `description`, `typeId`, `insertedon`, `insertedby`, `updatedon`, `updatedby`) VALUES
(485, 'Steel Canyon Golf Club', '460 Morgan Falls Road', 'Sandy Springs', 61, 11, '30350', '770.390.0424', 'http://www.steelcanyongolfclub.com/sites/courses/heritagegc.asp?id=533&page=27390', 'Located in Sandy Springs on Morgan Falls Road, Steel Canyon is a really fun and different, 18 hole, par 61 executive golf course. We recently planted all new greens and renovated much of the golf course so it is looking pretty spiffy. In fact, it is better than ever. \r\n\r\nIt also has one awesome lighted practice facility where you can enjoy great grass, practice putting and chipping green, and new range balls. Add great PGA instruction and golf camps and you have the perfect place to master the game.', 16, '2012-07-18 01:57:11', 'trdalyjr', '2012-07-18 01:57:49', 'trdalyjr'),
(486, 'Dunwoody Country Club', '1600 Dunwoody Club Drive', 'Atlanta', 1, 11, '30305', '770.394.4492', 'http://www.dunwoodycc.org/', 'A well known golf course architect by the name of Mr. Willard C. Byrd was commissioned to design the course. Mr. Byrd began discussions on June 20, 1965. Design plans were completed in November of 1965. A contract was signed with Dalon Contracting Company to build the course for the price of $304,500 in January 1966. Construction of the course involved the grading of over 550,000 cubic yards of earth and shale rock. The irrigation system was installed for $70,000 and grass planting began in July for a cost of $28,000. Total cost, which included Mr. Byrds fee, was $425,319. The golf course was opened for limited play in late fall of 1966. With the golf course maturing slowly, Members conducted rock and weeding parties to remove rocks from the fairways and rough and weeds from the greens thus assisting the grounds crew personnel who were operating out of necessity on a very limited budget. The Rules of Play were to move the ball out of the rough if required.', 16, '2012-07-18 01:59:45', 'trdalyjr', '2012-07-18 02:00:37', 'trdalyjr'),
(487, 'Cherokee Town & Country Club', '665 Hightower Trl', 'Atlanta', 1, 11, '30350', '770.993.4401', 'https://www.cherokeetcc.org/', '														\r\nChartered in 1956, Cherokee Town and Country Club is recognized as one of America''s premier private clubs. The club has two locations: the Town Club, which occupies the famed Grant Estate on West Paces Ferry Road in Buckhead and the Country Club, which is located near the Chattahoochee River in Sandy Springs.\r\n\r\nThe excellence of Cherokee''s facilities, combined with its commitment to the highest standards in dining and member services, has brought the club an extraordinary number of honors and awards throughout the years.', 16, '2012-07-18 02:02:22', 'trdalyjr', NULL, NULL),
(488, 'Lake Spivy Golf Club', '8255 Clubhouse Way', 'Jonesboro', 67, 11, '30326', '770.477.9836', 'http://www.lakespivey.net/', '														Lake Spivey Golf Club is metro-Atlanta''s most convenient golf course.  It offers a championship layout that includes 18 holes of fun, fair and challenging golf.  A balance of distance, contour, wooded roughs and water presents an enjoyable golf course for all levels of play.\r\nLake Spivey Golf Club was built in 1963.  We were the first course in the country to use Crenshaw Bentgrass greens in 1991.  We were voted by Golf Digest as the Best Value in Atlanta, GA during 2005.  We reconfigured the golf course in 2007 to add 5 sets of tees and a more modern layout.  We are proud of our golf club and know you will enjoy your day at Lake Spivey Golf Club.', 16, '2012-07-18 02:07:12', 'trdalyjr', NULL, NULL),
(489, 'College Park Golf Course', '3711 Fairway Dr', 'College Park', 68, 11, '30337', '404.761.0731', '', '', 16, '2012-07-18 02:09:46', 'trdalyjr', '2012-07-18 02:10:42', 'trdalyjr'),
(490, 'The Links Golf Club', '340 Hewell Rd', 'Jonesboro', 67, 11, '30238', '770.461.5100', 'http://golfatthelinks.com/index.html', 'The Links Golf Club is quickly taking its place as one of the best public courses in the Atlanta area. Each hole on the championship course gives golfers of all skill level a fair, but not overwhelming challenge on beautiful, rolling terrain. In addition The Wee Links, an executive length course, is excellent for novice, beginer, and junior golfers. The grill area has your favorite food and beverages available daily.														', 16, '2012-07-18 02:12:17', 'trdalyjr', NULL, NULL),
(491, 'Crystal Lake Golf and Country Club', '100 Crystal Lake Blvd', 'Hampton', 1063, 11, '30228', '770.471.3233', 'http://www.crystallakecc.com/', '														', 16, '2012-07-18 02:14:22', 'trdalyjr', NULL, NULL),
(492, 'Eagles Landing Country Club', '100 Eagles Landing Way', 'Stockbridge', 69, 11, '30281', '770.389.2000', 'http://www.clubcorp.com/Clubs/Eagles-Landing-Country-Club', 'The plantation-style clubhouse at Eagle''s Landing exemplifies Georgian charm looking down on some of the most beautiful scenery in the state. The challenging 27-hole championship course, designed by Tom Fazio, is the centerpiece of the Clubs outstanding facilities.													', 16, '2012-07-18 02:15:55', 'trdalyjr', NULL, NULL),
(493, 'Bridgemill Golf Club', '1190 BridgeMill Avenue,', 'Canton', 70, 11, '30114', '770.345.5500', 'http://www.bridgemillathleticclub.com/bridge-mill-golf', '			In a city known for great golf courses, BridgeMill Athletic Club has a championship course considered phenomenal in its design and conditioning. \r\n\r\nDesigned by Desmond Muirhead, designer of Mission Hills (home of the LPGA Nabisco Championship) and consultant to Jack Nicklaus on Muirfield Village, and Georgia''s own 1987 Masters Champion Larry Mize, BridgeMill opened in late 1998 as one of the most well-balanced tests of golf in Atlanta. \r\n\r\nThe par-72 layout was masterfully carved into the rolling terrain and plays to 7,110 yards from the championship tees. With five sets of tees and a variety of landscapes, BridgeMill does not overemphasize any one aspect of the game. Touting a true island green, BridgeMill''s16th is one of the most recognized holes in Atlanta. 											', 16, '2012-07-18 02:20:02', 'trdalyjr', NULL, NULL),
(494, 'Bradshaw Farm Golf Club', '3030 Bradshaw Club Drive', 'Woodstock', 64, 11, '30188', '770.592.2222', 'http://www.bradshawfarmgc.com/', '														We invite you to escape to the foot of the North Georgia Mountains for a golf journey that is equal parts Southern hospitality and unabashed challenge. Chosen as one of the Top 10 Public courses in Georgia Bradshaw Farm draws on the history of the property it calls home and an unforgettable 27 holes that create an experience worth pursuing again and again ', 16, '2012-07-18 02:21:46', 'trdalyjr', NULL, NULL),
