(498, 'Ship & Anchor Pub', '5975 Roswell Rd NE # E361', 'Sandy Springs', 61, 11, '30328', '404.256.3550', 'http://www.dunwoodyrestaurantgroup.com/the-ship-anchor-pub.aspx', 'The Ship and Anchor opened in September 2004 in Sandy Springs. It has the feel of a London Pub in the City Centre with heavy Oak panelling and antique lighting. ''The Crow''s Nest'' is a private room that can hold up to 20 people for parties, family dinner, baby showers, or any other excuse to get a group of people together for a good time! The patio is shaded for those hot steamy days, but is perfect in the autumn. If it gets chilly, just ask and we will turn the heaters on for you. Since its opening, it has become the new Sandy Springs hotspot and is very popular with area residents and business people. Come by and see the 10'' x 8'' museum piece ship The Albatross or marvel at the 100 year old fireplace and 120 year old stained glass. Play darts with the locals or just relax with your better half!', 12, '2012-07-18 02:30:18', 'trdalyjr', '2012-07-18 02:30:56', 'trdalyjr'),
