(537, 'Ippolito''s', '6623 Roswell Road Northeast', 'Atlanta', 1, 11, '30328', '404.256.3546', 'http://www.ippolitos.net/', 'Ippolito''s Italian restaurant has been serving authentic Italian dishes in your neighborhood since 1989. We have enjoyed great success by providing our guests with a casual, friendly atmosphere and excellent service in addition to the healthy portions of our wonderful food. As you will see, our entrees range from homemade sandwiches, pizzas and calzones to delicious pastas to speciality chicken, veal and seafood dishes. We have a wide variety of wines to choose from and the desserts, well you just have to see them to believe them. Carry out is also available. We hope to see you soon. Bring the family and friends in for a great meal, some candle light, Frank Sinatra and lots of fun. We promise, you will love Ippolito''s!', 1, '2012-07-19 01:35:05', 'trdalyjr', '2012-07-19 01:35:23', 'trdalyjr'),
