(547, 'Persepolis', '6435 Roswell Road Northeast ', 'Atlanta', 1, 11, '30328', '404.257.9090', 'http://www.persepoliscuisine.com/', 'Persepolis Cuisine is one of the oldest and most authentic Persian cuisine in the Sandy Springs and Atlanta area.  Offering a daily Royal Persian Buffet from 11:30 AM to 3:00 PM, as well as, serving from our menu.  Our great food and service has put us among Atlanta''s Top 50 Restaurants and number one Persian cuisine by, reviewers such as Atlanta Journal Constitution, Atlanta Magazine, and Creative Loafing.  Our ambiance and cozy decor, casual dressing, and weekend belly dancers create a unique and relaxing atmosphere for our guests to enjoy their lunch or dinner experience.', 1, '2012-07-19 01:49:38', 'trdalyjr', '2012-07-19 01:49:48', 'trdalyjr'),
