(552, 'The Brickery', '6125 Roswell Road Northeast', 'Sandy Springs', 61, 11, '30328', '404.843.8002', 'http://www.thebrickery.com/', 'Large portions of freshly prepared food, served \r\nup with a genuine smile. The kind of place where \r\nyou would probably see a neighbor, wish you had \r\nordered what you see at the table next to you, \r\nand appreciate that the folks who own it actually \r\nrun it.\r\nWe feature the best baby back ribs in Atlanta, \r\nalong with wonderful salads, burgers, \r\nseafood, steaks, chicken, and desserts.\r\n\r\nCome see us, and know you are welcome.', 1, '2012-07-19 01:55:04', 'trdalyjr', '2012-07-19 01:55:13', 'trdalyjr'),
