(557, 'Le Petite Maison', '6510 Roswell Road Northeast', 'Sandy Springs', 61, 11, '30328', '404.303.6600', 'http://www.lapetitemaisonbistro.com/', 'Come enjoy France to its fullest.\r\n\r\nOwners/Chef Cathy and Aline Silberstein bring their 25 yrs bistro to Sandy Springs. Located on Roswell road close to Abernathy, La Petite Maison offers a romantic patio for those cool summer nights.\r\n\r\nCozy banquettes and red velvet booths, the dining room leaves a pleasant and charming setting, dim lighting and candles with soft French music playing in the background.You will experience the richness of the cuisine of Provence, filled with sun, sandy beaches and all the colorful and lively traditional flavors of southern France. A unique moment to arouse your senses to Provences gastronomy.\r\n\r\nWith a 29$ 3-course menu Monday thru Thursday, 2 daily seasonal specials and a fascinating dessert menu, you will understand why La Petite Maison has been rated one of Atlanta top French restaurant														', 1, '2012-07-19 01:58:20', 'trdalyjr', NULL, NULL),
