(559, 'Opera', '1150B Peachtree Street', 'Atlanta', 1, 11, '30309', '(404) 874-04', 'www.operaatlanta.com/', 'Opera is more than a destination, it is an entire experience. Opera Nightclub is the hottest club in Atlanta night life. Opera is located at 1150 Crescent Ave and is the most glamorous and sexy of all the Atlanta clubs. Each week at Opera Atlanta, you can find fashion shows and the best VIP service in Atlanta, including bottle service.', 9, '2012-07-19 01:59:31', 'michaeljmagnan@gmail.com', '2012-07-28 05:54:16', 'trdalyjr'),
