(563, 'Slopes BBQ-Sandy Springs', '200 Johnson Ferry Road Northeast', 'Sandy Springs', 61, 11, '30328', '404.252.3220', 'http://www.slopesbbq.com/', 'Slope''s BBQ prepares authentic Georgia Style Southern BBQ, available for dine-in and catering, for BBQ fans looking for consistent quality in a family-friendly setting.\r\n\r\nWe offer a wide variety of BBQ selections delivered in "Slope''s Style".  The combination of premium meats, old-school techniques, signature sauce, and friendly service will make you a believer in "Slope''s Style" BBQ.  It''s the best BBQ in Atlanta!', 1, '2012-07-19 02:01:45', 'trdalyjr', '2012-07-19 02:02:08', 'trdalyjr'),
