(570, 'Little Thai Cuisine', '220 Sandy Springs Circle NE # 209', 'Sandy Springs', 61, 11, '30328', '404.943.9189', 'http://www.littlethaicuisine.com/', 'At Little Thai Cuisine, we are dedicated to serve you the best in authentic Thai dishes. We believe in promoting a healthy life style by using fresh ingredients to proudly bring you the essence of Thai Cuisine from traditional recipes to our own distinctive specialties.', 1, '2012-07-19 02:08:50', 'trdalyjr', '2012-07-19 02:09:31', 'trdalyjr'),
