(579, 'Peter Chang''s Tasty China 2', '6450 Powers Ferry Rd', 'Sandy Springs', 61, 11, '30339', '678.766.8765', 'http://www.tastychina-2.com/about.php', 'Our restaurant is famous for Szechwan food that burst with many flavors; hot and numbing, spicy, sweet and sour. Every dish has its own unique flavor. Szechwan is a Province in the mountainous district in the center of China. The main ingredients of Szechwan food are mountain produce and river fish with red hot peppers, garlic and ginger. We also offer less-spicy food choices for people whodo not enjoy spicy dishes.', 1, '2012-07-19 02:16:48', 'trdalyjr', '2012-07-19 02:17:12', 'trdalyjr'),
(580, 'Erawang Organic Thai', '7537 Roswell Rd.', 'Sandy Springs', 61, 11, '30350', '770.399.3033', 'http://www.besterawan.com/', '', 1, '2012-07-19 02:18:04', 'trdalyjr', '2012-07-19 02:18:20', 'trdalyjr'),
(581, 'Chef Rob''s Caribbean Cafe', '5920 Roswell Rd NE Suite 117', 'Sandy Springs', 61, 11, '30328', '404.250.3737', 'http://chefrobscafe.com/', '', 1, '2012-07-19 02:19:33', 'trdalyjr', '2012-07-19 02:23:53', 'trdalyjr'),
(582, 'Sushi Huku', '6300 Powers Ferry Rd NW # 800', 'Atlanta', 1, 11, '30339', '770.956.9559', 'http://www.sushihuku.com/contactus.html', '', 1, '2012-07-19 02:24:53', 'trdalyjr', '2012-07-19 02:25:29', 'trdalyjr'),
(583, 'Mirage Persian Cuisine', '6631 Roswell Road Northeast ', 'Sandy Springs', 61, 11, '30328', '404.843.8300', 'http://www.miragepersiancuisine.com/', '														Located in the heart of Sandy Springs since 1997, Mirage is the oldest Persian restaurant in the Atlanta area.  The healthy delicious style of Persian cooking awaits you at Mirage where we celebrate good food and authentic Persian cuisine with pride every day.   From our succulent and mouth watering variety of beef, lamb, chicken, and seafood kebabs to our glorious and tasty mixed rice dishes, you are sure to find something on our menu to meet your high culinary expectations.  And if you are vegetarian, you have come to the right place as Mirage has been named one of Top 10 Restaurants for Vegetarians in Atlanta by Gayot.com, and ranked on top of vegetarian restaurants in Sandy Springs by Yahoo Local reviewers.', 1, '2012-07-19 02:26:26', 'trdalyjr', NULL, NULL),
(584, 'Three Dollar Cafe - Sandy Springs', '8595 Roswell Rd. NE', 'Sandy Springs', 61, 11, '30350', '770.992.5011', 'http://www.threedollarcafeatlanta.com/', 'Our restaurant originated with the name of Three Dollar Cafe in Atlanta in 1982.\r\nWe have been chosen as one of the top 25 restaurants in Atlanta since 1994. We are known for the best chicken wings in Georgia.\r\nThree Dollar Cafe, We still have Atlanta''s #1 chicken wings, cold beer, and great service.\r\nThree Dollar Cafe is your home away from home.\r\nKick back, relax and let our friendly staff take care of you.', 7, '2012-07-19 02:28:05', 'trdalyjr', '2012-07-28 05:53:30', 'trdalyjr'),
(585, 'Blue Grotto', '220 Sandy Springs Cir, Suite 205', 'Sandy Springs', 61, 11, '30328', '678.705.6688', 'http://bluegrottotapas.com/contact-us/', '', 1, '2012-07-19 02:29:29', 'trdalyjr', '2012-07-19 02:29:51', 'trdalyjr'),
(586, 'Joli Kobe Bakery & Cafe', '5600 Roswell Road Northeast', 'Atlanta', 1, 11, '30342', '404.843.3257', 'http://www.jolikobe.com/', 'Since 1985, we have been the signature neighborhood bakery serving the finest pastries, cakes and breads. With a grand renovation and re-opening we now offer even more exquisite pastries and bread. Come see and taste the difference.', 1, '2012-07-19 02:30:58', 'trdalyjr', '2012-07-19 02:31:15', 'trdalyjr'),
(587, 'Three Sheets-Sandy Springs', '6017 Sandy Springs Circle', 'Atlanta', 1, 11, '30328', '404.303.8423', 'http://www.threesheetsatlanta.com/', '', 1, '2012-07-19 02:32:23', 'trdalyjr', '2012-07-19 02:33:20', 'trdalyjr'),
(588, 'Double Zero Napoletana', '5825 Roswell Road', 'Atlanta', 1, 11, '30328', '404.991.3666', 'http://www.doublezeroatl.com/home/', 'Double Zero, a contemporary Southern Italian restaurant, offers our guests a unique experience rooted in the ingredients and flavors of the Campania region of Italy. By featuring Neapolitan pizza, fresh pastas, fresh seafood, unique Antipasti & Sfizi, handmade pastries, gelato, and bread, composed entrees featuring unique interpretations of classic regional dishes, and indigenous cured meats and cheeses, Double Zero aims to define Southern Italian cuisine for the Atlanta area.', 1, '2012-07-19 02:34:22', 'trdalyjr', '2012-07-19 02:34:45', 'trdalyjr'),
(589, 'Nancy G''s', '4920 Roswell Rd, Suite 55', 'Atlanta', 1, 11, '30342', '404.705.8444', 'http://nancygscafe.com/index.html', 'Welcome to Nancy G''s, a local cafe serving up contemporary Southern cooking in a relaxed at home atmosphere, where you can unwind and share great conversation over dishes that are as fresh and interesting as they are affordable.', 1, '2012-07-19 02:35:36', 'trdalyjr', '2012-07-19 02:36:45', 'trdalyjr'),
(590, 'FuegoMundo', '5590 Roswell Road Suite # A120', 'Sandy Springs', 61, 11, '30342', '404.256.4330', 'http://fuegomundo.com/', 'FuegoMundo, meaning a World of Fire, is the first of its kind restaurant in the United States, offering healthy South American cuisine thats authentic, natural and Kosher, with Fast Casual Service at lunch & Full-Service for Dinners. The restaurant now offers Daily Chef Specials to go along with their extensive Lunch & Dinner menus.', 1, '2012-07-19 02:39:46', 'trdalyjr', '2012-07-19 02:40:08', 'trdalyjr'),
(591, 'Sandy Springs Diner', '8612 Roswell Rd', 'Sandy Springs', 61, 11, '30350', '770.594.9272', 'http://www.sandyspringsdiner.com/#', 'Real Home Cooking at a Real Fair Price!', 1, '2012-07-19 02:41:15', 'trdalyjr', '2012-07-19 02:41:34', 'trdalyjr'),
(592, 'Sushi Mio', '6125 Roswell RD NE', 'Atlanta', 1, 11, '30328', '404.256.1686', 'http://sushimio.com/index.php', 'Sushi Chef Yi has worked in Los Angeles for 2 years, where he first learned the art of Japanese food, then moved to Georgia to be employed at 2 other japanese restaurants. He then settled at Sushi Mio, where he has been working as the head sushi chef since the opening of Sushi Mio in the winter of 1999. Now as the owner of Sushi Mio, he has spent quality time to mold the restaurant into his own masterpiece.', 1, '2012-07-19 02:42:28', 'trdalyjr', '2012-07-19 02:42:50', 'trdalyjr'),
(593, 'Cibo e Beve', '4969 Roswell Rd.', 'Atlanta', 1, 11, '30342', '404.250.8988', 'http://www.ciboatlanta.com/', '101 Concepts presents their latest addition to Atlanta''s exciting dining scene with the popular, authentic Italian restaurant Cibo e Beve. We celebrate the vibrant food, wine and culture of Italy, while paying respect to the best seasonal produce from local growers.\r\n\r\nWith an emphasis on sustainable agriculture, Executive Chef/Partner Linda Harrell brings her passion and experience of over 20 years to the table to delight our guests with cooking in the traditions of Italy.\r\n\r\nOur unique libations, created by resident Mixologist Justin Hadaway and his team, pay homage to the classics while creating stunningly innovative creations for our late night cocktail scene, served at Cibo''s handcrafted Zinc Bar.', 1, '2012-07-19 02:45:04', 'trdalyjr', '2012-07-19 02:46:29', 'trdalyjr'),
(594, 'Mellow Mushroom - Sandy Springs', '6100 Roswell RD NE', 'Sandy Springs', 61, 11, '30328', '404.252.5560', 'http://www.mellowmushroom.com/', '														', 1, '2012-07-19 02:49:03', 'trdalyjr', NULL, NULL),
(595, 'Fox Brother''s BBQ', '1238 Dekalb Ave', 'Atlanta ', 1, 11, '30307', '404.577.4030', 'http://www.mellowmushroom.com/', 'At Fox Bros Bar-B-Q we focus on our guests overall experience. From the service to the food, we want to be the best we can be. When you walk through the door at Fox Bros Bar-B-Q you are welcomed like you were an old family friend and then we make every effort to make sure you are comfortable in our home. We strive to serve the best food we can make and prove ourselves one plate at a time. So come on down, get comfortable, loosen the belt and get ready to dig in!', 1, '2012-07-19 02:50:56', 'trdalyjr', '2012-07-19 02:54:22', 'trdalyjr'),
(596, 'Nyonya Asian Cuisine', '7294 Roswell Road', 'Sandy Springs', 61, 11, '30328', '770.394.3071', 'http://www.nyonyaasiancuisine.com/', '', 1, '2012-07-19 02:55:44', 'trdalyjr', '2012-07-19 02:57:50', 'trdalyjr'),
(597, 'Sally''s Gluten Free Bakery', '5920 Roswell Rd #108a', 'Sandy Springs', 61, 11, '30328', '404.847.0211', 'http://www.sallysglutenfreebakery.com/', 'Sally''s Gluten Free Bakery is about providing you with a local spot where you can choose from a wide selection of scratch baked goods made fresh every morning. It''s also about having a place that you know is committed to: \r\n-	Doing only gluten free \r\n-	Adding new items from time to time\r\n-	Helping you navigate the gluten free lifestyle', 1, '2012-07-19 02:59:38', 'trdalyjr', '2012-07-19 03:01:37', 'trdalyjr'),
(598, 'A Royal Affair Cafe', '5920 Roswell Road Northeast', 'Sandy Springs', 61, 11, '30328', '404.252.7713', 'http://www.aroyalaffaircafe.com/', 'A Royal Affair Cafe''s mission is to help "Build Family Time with Good Food". Life is busy and too short to drive through every dinner on the way to the ball field and dance studio. We enjoy helping our customers. We offer good home-cooked meals at great prices. Imagine having the luxury of a cook in your home; just heat and serve without the clean-up!\r\n\r\nOur menus change daily so you don''t get tired of the same old thing...If you catch Lila soon enough she will even plan next weeks meals around you...So put in a request.', 1, '2012-07-19 03:03:47', 'trdalyjr', '2012-07-22 23:33:39', 'trdalyjr'),
(599, 'B''s Bistro', '6010 B1 Sandy Springs Circle', 'Sandy Springs', 61, 11, '30328', '404.389.9258', 'http://www.bsbistro.com/', '', 1, '2012-07-19 03:05:37', 'trdalyjr', '2012-07-19 03:05:51', 'trdalyjr'),
(600, 'North River Tavern', '8879 Roswell Road ', 'Sandy Springs', 61, 11, '30350', '770.552.8784', 'http://www.northrivertavern.com/', '', 1, '2012-07-19 03:07:24', 'trdalyjr', '2012-07-19 03:09:06', 'trdalyjr'),
(601, 'Napoli New York Style Pizzeria', '276 Hammond Drive Northeast', 'Sandy Springs', 61, 11, '30328', '404.252.0147', 'http://www.sandyspringspizza.com/', '', 1, '2012-07-19 03:09:55', 'trdalyjr', '2012-07-19 03:10:44', 'trdalyjr'),
(602, 'Figo Pasta-Sandy Springs', '1140 Hammond Dr NE # K135', 'Atlanta', 1, 11, '30328', '770.698.0505', 'http://www.figopasta.com/', 'We are the original Italian fresh pasta place, your neighborhood kitchen. Come with us, pick and choose and create hundreds of combinations of freshly prepared pastas, ravioli, salads, Panini, wine, beer, cocktails and much more.\r\n\r\nCome as you are old jeans or a bow tie fancy shoes or dusty sneakers parking a Ferrari or a beat-up Vespa. Come with us and you will enjoy an authentic Italian experience. Come join us and relax with your friends and family before you step back into your busy life.', 1, '2012-07-19 03:11:49', 'trdalyjr', '2012-07-19 03:12:05', 'trdalyjr'),
(603, 'Taco Mac - Sandy Springs', '5600 Roswell Rd Suite M-003', 'Atlanta', 1, 11, '30342', '404.941.1503', 'http://tacomac.com/locations/prado/', '', 1, '2012-07-19 03:14:35', 'trdalyjr', '2012-07-19 03:15:16', 'trdalyjr'),
(604, 'Kobe Steaks', '5600 Roswell Rd. NE', 'Atlanta', 1, 11, '30342', '404.256.0810', 'http://www.kobesteaks.net/index.shtml', 'Welcome to Kobe Steaks - At Kobe Steaks you''ll experience creative hibachi cooking right at your table in a fun-filled atmosphere. You''ll enjoy the knife-wielding skill and showmanship of specially trained chefs as they prepare meals before your eyes on hibachi grills. Whether it''s a birthday, an anniversary, a rehearsal dinner, a business meeting, or any occasion, Kobe Steaks can accommodate large or small groups.', 1, '2012-07-19 03:16:13', 'trdalyjr', '2012-07-19 03:17:21', 'trdalyjr'),
(605, 'Real Mandarin House', '6263 Roswell Road Northeast', 'Atlanta', 1, 11, '30328', '404.255.5707', 'http://www.mandarinhousesandysprings.com/style_1/', '', 1, '2012-07-19 03:18:53', 'trdalyjr', '2012-07-19 03:19:11', 'trdalyjr'),
(606, 'Evos', '5590 Roswell Road #140', 'Sandy Springs', 61, 11, '30342', '404.252.4022', 'http://www.evos.com/', '', 1, '2012-07-19 03:20:06', 'trdalyjr', '2012-07-19 03:20:32', 'trdalyjr'),
(607, 'R Rice', '1140 Hammond Drive Northeast ', 'Atlanta', 1, 11, '30328', '770.804.8155', 'http://www.r-ricedelivery.com/', '', 1, '2012-07-19 03:21:25', 'trdalyjr', '2012-07-19 03:21:52', 'trdalyjr'),
(608, 'Porto Brasil', '7887 Roswell Rd, Suite D', 'Sandy Springs', 61, 11, '30350', '770-390-2280', 'http://portobrazilrestaurant.com/', 'Come to Porto Brasil Restaurant, where a dining experience rich in flavor and heritage awaits you. The Brazilian tradition of grilling, or CHURRASCO (shoe-HAS-ko), is a fusion of South American and European cultures. From its birth in Brazil, to the sparkling beaches of Rio de Janeiro, Porto Brasil now extends this festive tradition to you. At Porto Brasil, meats and vegetables are carefully selected to ensure that only the freshest cuisine is served. Our meats are tastefully seasoned and cooked on skewers over open-flame grills.', 1, '2012-07-19 03:22:33', 'trdalyjr', '2012-07-19 03:23:09', 'trdalyjr'),
(609, 'Cafe Posh', '4920 Roswell Road Northeast', 'Atlanta', 1, 11, '30342', '404.303.7303', '', '', 1, '2012-07-19 03:24:48', 'trdalyjr', '2012-07-19 03:26:17', 'trdalyjr'),
(610, 'Las Tortas Locas', '5841 Roswell Rd NE', 'Atlanta', 1, 11, '30328', '404.844.4445', '', '', 1, '2012-07-19 03:27:01', 'trdalyjr', '2012-07-19 03:27:21', 'trdalyjr'),
(611, 'Ruth''s Chris Steakhouse-Sandy Springs', '5788 Roswell Road Northeast', 'Atlanta', 1, 11, '30328', '404.255.0035', 'http://www.ruthschris.com/Steak-House/1716/Atlanta/Sandy-Springs', 'Ruth''s Chris Steak House Sandy Springs welcomes you with an old world charm and air of casual elegance. Deep forest greens, accents of burnished golds, rich burgundies and two-story high windows dramatically flank the main steakhouse dining room and provide the perfect atmosphere for a romantic steak dinner, business lunch, or private party. The restaurant has seven private dining rooms that offer a variety of dining options for 10 to 60 guests. Whether it''s a business dinner, a social event, or a special celebration, Ruth''s Chris Sandy Springs can accommodate your needs.', 1, '2012-07-19 03:30:01', 'trdalyjr', '2012-07-19 03:30:07', 'trdalyjr');
INSERT INTO `venues` (`id`, `name`, `address`, `city`, `cityId`, `stateId`, `zip`, `phone`, `website`, `description`, `typeId`, `insertedon`, `insertedby`, `updatedon`, `updatedby`) VALUES
(612, 'Genki Noodles & Sushi - Sandy Springs ', '5590 Roswell Rd # 100', 'Atlanta', 1, 11, '30342', '404.843.8319', 'http://www.genkiatl.com/', '	Established in 1996 by Reid Zeising, Genki Noodles and Sushi now boasts three locations - Buckhead, The Prado in Sandy Springs, and Virginia-Highland. Offering fresh, artfully presented sushi, bountiful noodle bowls, and a variety of entrees for all tastes, Genki is open for lunch and dinner seven days a week and has become known for its reasonably priced and delicious Asian fusion cuisine that is served in a playful and casually upscale atmosphere.  													', 1, '2012-07-19 03:31:59', 'trdalyjr', NULL, NULL),
(613, 'Genki Noodles & Sushi - Buckhead', '3186 Roswell Road ', 'Atlanta', 1, 11, '30305', '404.844.8319', 'http://www.genkiatl.com/', '														Established in 1996 by Reid Zeising, Genki Noodles and Sushi now boasts three locations - Buckhead, The Prado in Sandy Springs, and Virginia-Highland. Offering fresh, artfully presented sushi, bountiful noodle bowls, and a variety of entrees for all tastes, Genki is open for lunch and dinner seven days a week and has become known for its reasonably priced and delicious Asian fusion cuisine that is served in a playful and casually upscale atmosphere.', 1, '2012-07-19 03:33:24', 'trdalyjr', NULL, NULL),
(614, 'Gruby''s New York Deli', '860 Johnson Ferry Road', 'Atlanta', 1, 11, '30342', '404.236.0060', 'http://www.grubysnydeli.com/index.html', 'ince the mid 1980''s, brothers Barry and Steven Gruber have owned and operated Gruby''s New York Deli.\r\n\r\nGrowing up in the Bronx during the 60''s And 70''s,  Barry and Steven received an invaluable education in their fathers meat market and deli.  Starting in the kitchen and the dining room,  they learned the business from the ground up.  In the early 80''s their families moved from New York to Hilton Head Island, SC, where the brothers saw an opportunity to fill a unique niche and created the first Gruby''s New York Deli on Hilton Head Island.  Combining their experience and knowledge of the deli business,  they focused on brining to the area the same quality products they grew up with in New York City.  Gruby''s was an immediate success.  In 2003 Gruby''s opened in Atlanta, Ga, and in 2009 they opened their third location by Sun City, Hilton Head.', 1, '2012-07-19 03:35:27', 'trdalyjr', '2012-07-19 03:36:53', 'trdalyjr'),
(615, 'Lotus', '8725 Roswell Rd # 11', 'Sandy Springs', 61, 11, '30350', '678.461.5666', '', '', 1, '2012-07-19 03:37:31', 'trdalyjr', '2012-07-19 03:37:51', 'trdalyjr'),
(616, 'Ray''s New York Pizza-Sandy Springs', '6309 Roswell Road', 'Atlanta', 1, 11, '30328', '404.252.9888', 'http://raysnewyorkpizza.com/index.html', 'In 1990, Atlanta''s Buckhead area was thriving in Business and nightlife... not pizza. A local Atlanta Business man, and a staple in the Buckhead social scene, wanted to bring a taste of his travels to the city he loved; and in 1990, opened Ray''s New York Pizza off of Peachtree Street. Ray''s became an instant hot spot for business lunchens and late night party goers alike. Buckhead has changed a good bit from "The Glory Days", but our pizza consists of the same quality and love it did long ago. Now, more than ever, Ray''s is entrenched with a never ending desire to produce the best pizza experience possible. Each location is locally owned and operated with the same desire as our founder.', 1, '2012-07-19 03:38:55', 'trdalyjr', '2012-07-19 03:39:39', 'trdalyjr'),
(617, 'Tijuana Joe''s-Sandy Springs', '7870 Roswell Rd', 'Sandy Springs', 61, 11, '30350', '770.817.5617', 'http://www.tijuanajoes.com/', '', 1, '2012-07-19 03:40:51', 'trdalyjr', '2012-07-19 03:41:18', 'trdalyjr'),
