(620, 'Sandy Springs Gun Club', '8040 Roswell Rd', 'Sandy Springs', 61, 11, '30350', '770.394.4867', 'http://www.sandyspringsshootingrange.com/default.aspx?categ=home', 'The Sandy Springs Gun Club and Range is equipped with an oversized dedicated class room equipped with a Firearms Training Simulator (F.A.T.S.) and state of the art audio visual aids for any training need. The range also has an exclusive members lounge for the range members. The members lounge has warm comfortable seating, card tables, widescreen televisions, satellite, Blue Ray disk player, gun cleaning station, lockers available for members to rent, and free Wi-Fi.\r\n\r\nThe Sandy Springs Gun Club and Range are able to host corporate and private group functions and classes.', -1, '2012-07-20 01:59:52', 'trdalyjr', '2012-07-20 02:00:13', 'trdalyjr'),
(621, 'Quickshot', '1199 Zonolite Rd.', 'Atlanta', 1, 11, '30306', '404.963.1962', 'http://www.quickshotshootingrange.com/', 'Quickshot Shooting Range is a state of the art indoor shooting range in the heart of Atlanta.  We feature seven 50 foot lanes and seven 75 foot lanes.  Our facility is fully heated and air conditioned for a comfortable shooting environment even on the hottest day. We feature a state of the art air handling system using hepa-filter technology.   \r\nWe are located off Briarcliff Road near the Emory Campus, minutes from Virginia Highlands, Little Five, Midtown and Lenox neighborhoods.', -1, '2012-07-20 02:01:55', 'trdalyjr', '2012-07-20 02:01:59', 'trdalyjr'),
(622, 'Tom Lowe', '3070 Merk Rd. SW', 'Atlanta', 1, 11, '30349', '404.346.8382', 'http://www.deshotelsarms.com/', 'The Tom Lowe Trap & Skeet Range is a municipal trap and skeet range consisting of 20 combination trap and skeet fields, and a 5-stand sporting clays field. We are open to the public and welcome first time shooters. Only shotgun shooting is allowed at our facility. We have instructors available by appointment. Everything you need to shoot can be purchased or rented at the pro shop. Eye and ear protection are mandatory. We host a Tuesday night league all four seasons of the year and a beginner''s trap league on Sundays. We do not take reservations except for corporate or group outings.', -1, '2012-07-20 02:04:05', 'trdalyjr', '2012-07-20 02:04:11', 'trdalyjr'),
(623, 'Red Baron''s', '6450 Roswell Rd', 'Sandy Springs', 61, 11, '30328', '404.252.3770', '', '', -1, '2012-07-20 02:06:24', 'trdalyjr', '2012-07-20 02:06:36', 'trdalyjr'),
(624, 'Blue Ridge Grill', '1261 West Paces Ferry Road', 'Atlanta', 1, 11, '30327', '404.233.5030', 'http://www.blueridgegrill.com/', 'Long established as one of the "in spots" for Atlanta''s movers and shakers, this cozy, sophisticated restaurant sets the standard for style in Buckhead.\r\n\r\nWarm and inviting like a centuries old cabin, the Blue Ridge Grill pays homage to the Blue Ridge Mountains. An immense stacked-stone fireplace, timbers rescued from an 1890''s cotton mill, painted log walls and comfortable red leather booths create the unique combination of rustic, yet casual, elegance.\r\n\r\nOwners Susan DeRose and Richard Lewis fashioned Blue Ridge Grill as a testament to their Southern heritage.', 1, '2012-07-20 03:01:18', 'trdalyjr', '2012-07-20 03:01:22', 'trdalyjr'),
(625, 'Legacy Links Golf Course', '1825 Windy Hill Rd.', 'Smyrna', 60, 11, '30080', '770.434.6331', 'http://www.legacyfoxcreek.com/sites/courses/layout9.asp?id=875&page=49184', 'Legacy Golf Links was designed by Larry Nelson, former PGA player and Georgia native. Legacy is a par 58 executive golf course tucked in between towering Georgia Pines in the city of Smyrna. The course features Bermuda grass fairways and Brand New Champion Bermuda grass greens. Legacy offers a quick but challenging round of golf for golfers of all playing abilities.														', 16, '2012-07-20 23:38:52', 'trdalyjr', NULL, NULL),
(626, 'Fox Creek Golf Club', '1501 Windy Hill Rd.', 'Smyrna', 60, 11, '30080', '770.435.1000', 'http://www.legacyfoxcreek.com/sites/courses/layout9.asp?id=875&page=49184', '														Fox Creek Golf Club was designed by famed designer John LaFoy. Fox Creek is a beautiful Par 62 golf course nestled in the historic city of Smyrna surrounded by towering Georgia pines.  The course features Bermuda grass fairways and new Champion Bermuda grass greens. Fox Creek offers a quick but challenging round of golf for golfers of all playing abilities.', 16, '2012-07-20 23:39:59', 'trdalyjr', NULL, NULL),
(627, 'Bass Pro Shops-Atlanta', '5900 Sugarloaf Parkway', 'Lawrenceville', 14, 11, '30342', '678.847.5500', 'http://www.basspro.com/webapp/wcs/stores/servlet/CFPageC?storeId=10151&catalogId=10051&langId=-1&appID=94&storeID=3', '', -1, '2012-07-20 23:41:43', 'trdalyjr', '2012-07-20 23:42:08', 'trdalyjr'),
(628, 'Lenox Square Mall', '3393 Peachtree Road ', 'Atlanta', 1, 11, '30326', '404.365.8860', 'http://www.simon.com/mall/?id=207http://www.simon.com/mall/?id=207', 'Offering more choices since 1959, Lenox Square is the Southeast''s premier shopping destination.  Lenox Square is anchored by Bloomingdale''s, Neiman Marcus and Macy''s, and features nearly 250 specialty stores - shops like FENDI, Anthropologie, L''OCCITANE, Burberry, Brooks Brothers, Cartier, David Yurman, Louis Vuitton, Bvlgari, Ralph Lauren, Salvatore Ferragamo, St. John, Herve Leger, Henri Bendel, Ermenegildo Zegna and Forever 21.  Experience fine dining at Prime, we also invite you to enjoy a meal at one of five casual eateries, or even a quick bite at one of a wide selection of specialty food shops at the food court.  Lenox Square has always offered more choices, and now offers more choices than ever.', -1, '2012-07-20 23:44:22', 'trdalyjr', '2012-07-20 23:44:27', 'trdalyjr'),
(629, 'Phipps Plaza', '3500 Peachtree Rd NE', 'Atlanta', 1, 11, '30326', '404.262.0992', 'http://www.simon.com/mall/?id=210', 'The South has spoken and the word is Phipps Plaza is among the best of the South! Phipps Plaza - named a "Southern Best" in Southern Living magazine''s Readers'' Choice Awards - is anchored by Nordstrom, Belk, and Saks Fifth Avenue. As the Southeast''s premier upscale shopping center, Phipps Plaza is home to more than 100 specialty stores including Gucci, Giorgio Armani, Jimmy Choo, and Juicy Couture.  At Phipps Plaza you''ll also find four full service restaurants and a 14-screen AMC theatre.  The Phipps Plaza Valet is located at both the Peachtree Road entrance and AMC/Davio''s entrance and is available to guests for a fee of $10.', -1, '2012-07-20 23:47:52', 'trdalyjr', '2012-07-27 23:45:13', 'hesomp'),
