(635, 'Fanoos Persian Cuisine', '6125 Roswell Rd NE Ste 104 B', 'Sandy Springs', 61, 11, '30328', '404.256.2099', 'http://fanoospersiancuisine.com/', 'Fanoos is a fine-dining restaurant and event facility that serves guests authentic Persian and Mediterranean Cuisine in Sandy Springs, Georgia. Live Belly Dancing on Friday and Saturday nights. The restaurant is open daily for lunch and dinner.', 1, '2012-07-21 00:01:58', 'trdalyjr', '2012-07-21 00:04:38', 'trdalyjr'),
