(637, 'Atena Pizza', '5975 Roswell Rd. Suite 215-B', 'Sandy Springs', 61, 11, '30328', '404.843.2333', 'http://www.atenapizza.com/', 'Atena Pizza Starts with carefully crafted freshly mixed dough allowed to rise to perfection in the pan, then we add our special pizza sauce made from only fresh packed tomatoes, next we top your pizza with 100% real mozzarella cheese, your choice of the freshest vegetables and tastiest meats.', 1, '2012-07-21 00:11:45', 'trdalyjr', '2012-07-21 00:12:14', 'trdalyjr'),
(638, 'Egg Harbour Cafe-Sandy Springs', '5920 Roswell Road', 'Sandy Springs ', 61, 11, '30328', '404.389.9915', 'http://eggharborcafe.com/', 'At Egg Harbor Cafe Sandy Springs you will find great service and our eggs-traordinary breakfast and lunch creations along with our children''s menu, daily specials and seasonal menu selections, a gluten free menu, and delicious catering fare. You can always find healthy choices at Egg Harbor Cafe Sandy Springs. The restaurant is available to host your showers, meetings and special fundraising events. Ask a restaurant manager for details.', 1, '2012-07-21 00:14:01', 'trdalyjr', '2012-07-21 00:15:55', 'trdalyjr'),
