(640, 'Atlanta Country Club', '500 Atlanta Country Club Drive', 'Marietta', 4, 11, '30367', '770.953.2100', 'https://www.atlantacountryclub.org/default.aspx', 'Exceptional Golf is the essence of the Atlanta Country Club. Always challenging and exciting, it always rewards a well-played game. Avid golfers among our membership agree: The more you play our championship course, the more you appreciate it. The picturesque rolling hills of the ACC course are beautifully landscaped and surrounded by historic Civil War sites. The Chattahoochee River is nearby and historic Sope Creek meanders its way through the course. The uniqueness and beauty of each hole, with bent grass greens and Bermuda fairways, complement the challenge of playing at ACC. The five choices of tee boxes are designed to accommodate all skill levels, from the beginner to the professional. Whether you take a golf cart, use a caddy or walk the course; a day of golf at ACC will be an experience you long remember. For those who enjoy practicing, ACC has it all, first class putting greens, a multi-tiered driving range and a short game practice area.', 1, '2012-07-21 00:22:19', 'trdalyjr', '2012-07-21 00:23:21', 'trdalyjr'),
