(733, 'Grand Ole Opry House', '2804 Opryland Drive', 'Nashville', 8, 45, '37214', '615.871.6779', 'http://www.opry.com/', 'What began as a simple radio broadcast in 1925 is today a live-entertainment phenomenon. Dedicated to honoring country musics rich history and dynamic present, the Grand Ole Opry showcases a mix of country legends and the contemporary chart-toppers who have followed in their footsteps.\r\n\r\nThe Opry, an American icon and Nashville, Tennessees number-one attraction, is world-famous for creating one-of-a-kind entertainment experiences for audiences of all ages.', 5, '2012-07-28 19:57:09', 'screenscrape', '2012-07-31 23:56:03', 'trdalyjr'),
