(742, '12th and Porter', '114 12th Avenue North', 'Nashville', 8, 45, '37203', '615.320.3754', 'http://12thandporterlive.com/', 'Anyone who has seen a show at 12th & Porter will probably tell you it is one of the best sounding rooms in Nashville. What they will also tell you, if they have been in Nashville for more than 24 hours, is that the club is not only Nashvilles, but also one of the countrys premiere and legendary clubs. The home of classic live recordings dating back to Townes Van Zandts Live and Obscure (circa 1985), the stage at 12th and Porter has hosted to some of the greatest touring artists and songwriters ever to play. Ryan Adams dropped 12th and Porters name in the lyrics of his Demolition record. Over the course of the thousands of shows and bands that have played at 12th and Porter, the club has experienced countless once in a lifetime moments. 12th & Porter is no stranger to rare only-in-Nashville shows. In August 2005, Neil Young performed an unannounced 45-minute solo show. 12th and Porter proudly continues its leading role in Nashvilles musical skyline.\r\n12th & Porter was recently voted by readers of the Nashville Scene as 2nd only to the historic Ryman Auditorium as Nashvilles best place to hear live music. 12th & Porter operates daily as Nashvilles premiere label showcase venue as well as one of the most respected indie rock venues in the Southeast USA', 5, '2012-07-28 19:57:09', 'screenscrape', '2012-07-31 23:27:55', 'trdalyjr'),
